INSERT INTO `products_tb` VALUES (1509,'SM-S931BZSGTUR',11126,5,'Galaxy S25 12/256 Gb Akıllı Telefon','Galaxy S25, Snapdragon 8 Elite, 6.2\" Dynamic AMOLED, 120Hz, 12GB RAM, 256GB depolama, 50+12+10MP arka, 12MP ön kamera, 8K video, 4000mAh batarya, hızlı/kablosuz şarj, 5G, NFC, USB-C, IP sertifikalı, Android, Yüz Tanıma, Parmak İzi','samsung_galaxy_s25_12_256_gb_ak__ll___telefon_1749077664',123456,'2025-06-05 01:54:24',NULL,1),(1510,'MXVX3TU/A/147128',11126,6,'iPhone 16 Plus 128 GB Akıllı Telefon Laciverttaş','KAMERA DENETİMİ İLE KONTROL SİZDE — Kamera Denetimi, zoom ve alan derinliği gibi kamera araçlarına hızlıca erişmenin daha kolay bir yolunu sunuyor. Böylece çok kısa sürede kusursuz fotoğraflar ve videolar çekebiliyorsunuz.\n\n\nDAHA YAKIN VE DAHA GENİŞ — Otomatik netleme özelliğine sahip Ultra Geniş kamerayla inanılmaz net, detaylı makro fotoğraflar ve videolar çekebiliyorsunuz. 48 MP Fusion kamerayla yüksek çözünürlüklü büyüleyici görüntüler yakalayabiliyor veya 2 kat optik kalitede Telefoto ile zoom yapabiliyorsunuz.\n\n\nFOTOĞRAFİK STİLLER — Yeni nesil Fotoğrafik Stiller, yaratıcılığınıza daha fazla alan açıyor. Böylece her fotoğrafta kendinizi daha çok yansıtabiliyorsunuz. Ve seçtiğiniz herhangi bir stili istediğiniz zaman geri alabiliyorsunuz.\n\n\nÇOK AKILLI A18 ÇİP — A18, iPhone 15’teki A16 Bionic çipin iki nesil ilerisinde. Gelişmiş fotoğraf ve video özelliklerinin yanı sıra harika bir verimlilikle konsol seviyesinde oyunlara güç veriyor.\n\n\nDAHA UZUN PİL ÖMRÜ — iPhone 16 Plus, A18 çiple beraber çalışarak 27 saate kadar video oynatmayı sağlayan çok daha uzun bir pil ömrü sunuyor. USB-C ile şarj edin veya daha hızlı kablosuz şarj için MagSafe şarj aygıtına yerleştirin.\n\n\nDAYANIKLI TASARIM — 6.1 inç Super Retina XDR ekranıyla iPhone 16, havacılık ve uzay endüstrisi standartlarında dayanıklı bir tasarıma sahip ve yeni nesil Ceramic Shield ön yüzeyi ile son derece sağlam.\n\n\nDAYANIKLI TASARIM — 6.7 inç Super Retina XDR ekranıyla iPhone 16 Plus, havacılık ve uzay endüstrisi standartlarında dayanıklı bir tasarıma sahip ve yeni nesil Ceramic Shield ön yüzeyi ile son derece sağlam.\n\n\nKARŞINIZDA EYLEM DÜĞMESİ — En sevdiğiniz özelliğe giden hızlı bir yol. El feneri, sesli not, Sessiz mod gibi birçok eylemi başlatmak için düğmeyi basılı tutmanız yeterli.\n\n\nIPHONE’UNUZU KİŞİSELLEŞTİRİN — iOS 18 ile Ana Ekran simgelerinizi istediğiniz bir renk tonuna ayarlayabiliyorsunuz. Yeniden tasarlanan Fotoğraflar uygulamasında en sevdiğiniz fotoğrafları daha hızlı bulabiliyorsunuz. Ve Mesajlar uygulxamasında herhangi bir kelimeye, ifadeye veya emojiye eğlenceli ve animasyonlu efektler ekleyebiliyorsunuz. ','iphone_16_plus_128_gb_ak__ll___telefon_lacivertta___1750025268',123456,'2025-06-16 01:07:48',NULL,1),(1511,'780010513',11126,7,'14 Ultra 512 GB 16 GB Ram (Xiaomi Türkiye Garantili) Beyaz','Xiaomi\'nin son teknoloji harikası, güçlü performansı ve zengin özellikleriyle dikkat çeken bir akıllı telefon olan bu cihaz, Snapdragon® 8 Gen 3 Mobil Platform\'u ve 4 nm enerji tasarruflu üretim süreciyle donatılmış. Kullanıcıya akıcı bir deneyim sunan WQHD+ 6,73 inç AMOLED ekranı, LTPO ve AdaptiveSync Pro teknolojileriyle dinamik bir yenileme hızı sunar. Leica profesyonel optik lenslerle donatılmış dört arka kamera, çeşitli çekim modları ve video özellikleriyle kullanıcılarına geniş bir yaratıcı özgürlük sunar. 5000 mAh (tipik) batarya, Xiaomi Pil Yönetim sistemi ve 90 W Ultra Hızlı Şarj ile güçlü bir pil performansı sağlar. Güvenlik ve bağlantıda da öne çıkan özellikler arasında ekran içi parmak izi sensörü, yapay zeka destekli yüz tanıma, NFC, 5G bağlantısı ve Wi-Fi 7 özelliği bulunur. Xiaomi HyperOS işletim sistemiyle birlikte sunulan bu ürün, kullanıcıların ihtiyaçlarını karşılamak için tasarlanmıştır ve birçok kullanıcı beklentisini karşılayacak özelliklere sahiptir.','xiaomi_14_ultra_512_gb_16_gb_ram__xiaomi_t__rkiye_garantili__beyaz_1750154509',123456,'2025-06-17 13:01:49',NULL,1),(1512,'1600843-71315',11113,8,'Mavi Logo Baskılı Sarı Tişört 1600843-71315','Mavi Mavi Logo Baskılı Sarı Tişört 1600843-71315\r\nLogo Baskılı Sarı Tişört, yüzde yüz pamuklu orta ağırlıkta kumaştan üretilmiştir. Oversize, geniş kesim ve uzun yapısıyla rahat bir kullanım sunan bu tişört, bisiklet yakası ve kısa kollarıyla öne çıkar. Ön yüzündeki turuncu renkli logo baskısı ile sade ve şık bir görünüm sağlar. Oversize / Geniş Kesim Kısa Kol Manken ölçüsü: Boy:177 cm / Bel:61 cm / Göğüs:86 cm / Kalça:93 cm','mavi_logo_bask__l___sar___ti____rt_1600843-71315_1750288988',123457,'2025-06-19 02:23:08',NULL,1),(1513,'5463634213',11112,9,'Baskılı Kısa Elbise','Mango Baskılı Kısa Elbise\r\nİçerik: %59 Geri Dönüştürülmüş Polyester, %36 Polyester, %5 Elastan\r\n\r\nÇiçek desenli,Akışkan kumaş,Kalp yaka,İnce askılar,Düz tasarım,Kısa tasarım,Kapatılmamış','bask__l___k__sa_elbise_1751036628',123458,'2025-06-27 18:03:48',NULL,1),(1514,'32141234casd',11127,1,'10\'lu Ekonomik Paket Patik Unisex Kısa Spor Sneakers Çorap','Sky Socks 10\'lu Ekonomik Paket Patik Unisex Kısa Spor Sneakers Çorap\r\n\r\nUnisex - Standart boy olarak üretilmiştir. Çoraplarımız \'oeko-Tex 100\' standartlarına uygun olarak üretilmiştir. ( Tekstilde zararlı kimyasallara ve maddelere karşı güvenilirlik belgesidir.) Comfortm dikişleri sayesinde ayağınızın güvenli ve rahat olmasını sağlar. BirinciI sınıf kalite ile üretilmiş çoraplarımız, farklı seçenekli renk ve desenler ile kombinlerinizin vazgeçilmezi haline gelecek.','10_lu_ekonomik_paket_patik_unisex_k__sa_spor_sneakers___orap_1751036899',123458,'2025-06-27 18:08:19',NULL,1),(1515,'1231231234433',11112,4,'Kadın Yeşil Flower Desen Kruvaze Yaka Pliseli Beli Lastikli Midi Boy Elbise','Kadın Yeşil Flower Desen Kruvaze Yaka Pliseli Beli Lastikli Midi Boy Elbise\r\nRegular kalıptır. Bahar ve yaz için uygundur.','kad__n_ye__il_flower_desen_kruvaze_yaka_pliseli_beli_lastikli_midi_boy_elbise_1751038159',123458,'2025-06-27 18:29:19',NULL,1),(1516,'2311345435345',11113,10,'Defactofit Nba Wordmark Oversize Fit Bisikl