leceğiniz bu ürün, günlük yaşamınızda vazgeçilmez bir yardımcı olacak. İster iş hayatınızda, ister kişisel kullanımda, her an yanınızda taşıyabileceğiniz bu bellek, sizi yarı yolda bırakmaz.\r\n\r\nDijital verilerinizi organize ederken, aynı zamanda zamandan tasarruf etmenizi sağlar. Kingston\'un güvenilirliği ve kalitesiyle üretilen bu bellek, uzun ömürlü kullanım sunar. Her anınızı güvenle saklayabilir, istediğiniz zaman kolayca erişebilirsiniz.\r\n\r\nKendinizi dijital dünyada daha güvende hissetmeniz için tasarlanan Kingston Flash Bellek, hızlı veri transferi ve geniş depolama kapasitesiyle dikkat çekiyor. Bu ürünü kullanarak, dijital dünyanızı daha düzenli ve erişilebilir hale getirebilirsiniz.\r\nÖne Çıkan Özellikler:\r\n\r\n    Geniş Depolama Kapasitesi: 64 GB kapasitesiyle tüm dosyalarınızı kolayca saklayın.\r\n    Hızlı Veri Transferi: 3.2 bağlantı hızıyla verilerinizi hızlıca aktarın.\r\n    Kompakt Tasarım: Her yere taşınabilir, pratik kullanım sunar.','flash_bellek_64_gb_3_2_kingston_dtx-64gb_1755424782',123456,'2025-08-17 12:59:42',NULL,1),(1526,'DTXM/128',11133,12,'Dtxm 128GB USB 3.2 Gen.1 Datatraveler Exodia M Flash Bellek DTXM/128','DTXM 128GB USB 3.2 Gen.1 DataTraveler Exodia M Flash Bellek DTXM/128\r\nKingston DataTraveler® Exodia™ M, dizüstü ve masaüstü bilgisayarlar, monitörler ve diğer dijital cihazlar için bir USB 3.2 Gen 1 uyumlu veri saklama çözümüdür. DT Exodia M, belgelerin, müziklerin, videoların ve diğer dosyaların hızlı transferine ve rahat biçimde saklanmasına olanak tanımaktadır. 256GB’a 1 varan kapasitelere göre birden fazla şık renk seçenekleri ile sunulmaktadır. Pratik tasarımı ile işte, evde ya da okulda kullanım için ideal bir taşınabilir bellek haline gelmektedir. DT Exodia M beş yıl garantilidir ve efsanevi Kingston® güvenirliği ile sunulmaktadır.','dtxm_128gb_usb_3_2_gen_1_datatraveler_exodia_m_flash_bellek_dtxm_128_1755424920',123456,'2025-08-17 13:02:00',NULL,1),(1527,'HBCV00008MUT7S',11133,13,'Moon 64 GB USB 3.1 Ultra Speed Metal USB Flash Bellek','Philips Moon 64 GB USB 3.1 Ultra Speed Metal USB Flash Bellek\r\n\r\nUltra Hızlı Veri Aktarımı, Beklemeye Son\r\nPhilips USB 3.1 bellek, 100-150 MB/s’ye varan okuma hızlarıyla büyük boyutlu dosyaları saniyeler içinde kopyalayabilmenizi sağlar. USB 2.0 ve USB 3.0 ile de geriye dönük uyumluluğu sayesinde birçok cihazda rahatça kullanılır. Fotoğraflarınızı, videolarınızı, müziklerinizi ya da önemli belgelerinizi hızlı ve güvenli bir şekilde taşıyabilirsiniz.\r\n\r\nModern, Şık ve Dayanıklı Tasarım\r\nMetal gövdesiyle modern ve zarif bir görünüm sunan bu flash bellek, hem estetik hem de dayanıklılık açısından öne çıkar. Ay şeklindeki yuvarlak formu sayesinde anahtarlığınıza kolayca takılır, böylece her zaman yanınızda taşıyabilirsiniz.\r\n\r\nKapaksız ve Pratik Kullanım\r\nUSB girişi, dış gövde ile korunur; böylece kaybolabilecek bir kapağa ihtiyaç duymaz. Tak ve çalıştır özelliği sayesinde herhangi bir yazılım kurulumuna gerek olmadan anında kullanabilirsiniz.\r\n\r\nCebe Sığan Güçlü Depolama\r\nKompakt boyutları sayesinde cebinizde, çantanızda ya da anahtarlığınızda kolayca taşıyabilir, tüm multimedya dosyalarınızı her yerde erişilebilir tutabilirsiniz. Fotoğraflar, müzikler, videolar ve kişisel verileriniz her zaman elinizin altında.\r\n\r\n\r\nVeri Aktarım Hızı: USB3.1 (okuma ~100-150 MB/s)\r\nBağlantı Tipi: USB-A\r\nMalzeme: Metal','moon_64_gb_usb_3_1_ultra_speed_metal_usb_flash_bellek_1755528520',123459,'2025-08-18 17:48:40',NULL,1),(1528,'A1367',11132,14,'326 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 15W 2 Çıkışlı Powerbank - Siyah - A1367 (Anker Türkiye Garantili)','Yüksek Kapasite\r\n\r\n2000 mAh taşınabilir şarj cihazı, iPhone 15/14 için 4.5 kez şarj sağlar, Galaxy S23 için ise 3.8 kez şarj sağlar.\r\nDijital Ekran ve Kompakt Tasarım\r\n\r\nİnce tasarım, avuç içinde veya cepte akıllı telefonların yanında rahatça sığar. Dijital ekranla da kolay kullanım sağlar.\r\nÇift Yönlü Çıkış\r\n\r\nAynı anda 2 cihaz şarj edilebilir.','326_20000_mah_ta____nabilir_h__zl_____arj_cihaz___-_usb-c_-_15w_2_____k____l___powerbank_-_siyah_-_a1367__anker_t__rkiye_garantili__1755529290',123459,'2025-08-18 18:01:30',NULL,1),(1529,'HBV00000WC9KY',11132,7,'Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank - Siyah','USB-A portuyla gelen cihaz, aynı anda iki farklı telefonu ya da tableti şarj edebiliyor. USB-C portu ise modelin kendisinin şarj edilmesinde görev alıyor.\r\n\r\nDünya genelinde teknolojinin gelişmesi ile birlikte birçok kişi farklı teknolojik ürünler tercih etmektedir. Genellikle yaygın olarak tercih edilen teknolojik ürünler, bir güç ile çalıştığından dolayı bu teknolojik ürünlerde, güç için elektrik kullanılmaktadır. Teknolojik ürünler arasında en yaygın olarak tercih edilen ve birçok kişinin gözde teknolojik ürünlerinden bir tanesi, Akıllı Cep Telefonu olmaktadır. Akıllı cep telefonu kullanımını, diğer teknolojik ürünlere göre daha rahat bir şekilde tercih edilmektedir. Akıllı cep telefonları pil ile çalıştığından dolayı tekrar şarj edilerek kullanılabilmektedir. Şarj konusunda telefonu şarj etmek için zorunlu olarak birçok kişi, priz yanlarında bekler. Bu tarz durumların yaşanmaması için teknoloji ile birlikte gelişen en önemli ürünlerden bir tanesi, taşınabilir şarj aletleridir.\r\n\r\nKullanım açısından daha rahat ve daha konforlu bir şekilde kullanım sağlayabileceğiniz taşınabilir şarj aletleri, bir diğer ismi ile Powerbank olarak bilinir. Taşınabilir şarj aleti olarak kullanılan powerbank modelleri arasında en çok tercih edilen ve en yaygın olarak kullanılabilen çeşitlerinden bir tanesi, Xiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank modelidir. Kullanım açısından rahat ve konforlu bir şekilde kullanılabilen ve birçok kişinin şarj aleti olarak rahatlıkla kullanım sağlamış olduğu bu ürün, powerbank konusunda diğer modellere göre daha yaygın bir şekilde tercih edilmektedir.\r\n\r\nXiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank, avantaj bakımından birçok farklı girişe sahiptir. Usb girişi olarak kullanılan girişler ile birlikte hızlı bir şekilde şarj edebilme özelliğine sahip olan bu ürün, daha sonrasında hızlı bir şekilde tekrar dolum olması ile uzun bir süre kullanımı sağlanabilmektedir. Toplam 8 saatte şarj olması ile birlikte, girişlere uygun bir şekilde kullanımı sağlanabilmektedir. 20000 Mah depolama sayesinde, telefonunuzun batarya kapasitesine göre ortalama olarak 4 defa şarj edebilirsiniz.\r\nXiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank Kullanırken Dikkat Edilmesi Gerekenler\r\n\r\nKullanım açısından rahat bir şekilde kullanım sağlayabileceğiniz ve birçok kişinin yaygın bir şekilde kullanmış olduğu Xiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank, kullanım esnasında dikkat edilmesi gereken birçok farklı durum bulunmaktadır. Xiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank kullanırken özellikle dikkat etmeniz gereken şeylerden bir tanesi, sıvı teması konusunda dikkat etmenizdir. Sıvı ile herhangi bir şekilde temas etmesi durumunda, içerisinde bulunan devreler zarar görebilmektedir. Bu tarz durumlardan dolayı verimli bir şekilde çalışmayarak, herhangi bir şekilde kullanım sağlanamayabilir.\r\n\r\nXiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank kullanırken dikkat etmeniz gereken durumlardan bir tanesi, sıcak ortamlarda fazla bir şekilde bulunmamasıdır. Genellikle arabada veya ev ortamında kullanım sağlanmış olsada, özellikle yaz sıcaklarında yüksek sıcaklığa sahip olan yerlerde tutmamanız daha sağlıklı olacaktır. Sıcak bir yerde kaldığı zaman içerisinde bulunan şarj edilebilir pillerin ömrü kısalması ile birlikte, yüksek sıcaklıklarda genleşme durumu yaşanabilmektedir. Xiaomi Redmi 20000 Mah Taşınabilir Hızlı Şarj Cihazı - USB-C - 18W 2 Çıkışlı Powerbank güç ve performans açısından ilk günkü gibi kullanılması için, bu tarz durumlara dikkat edilmesinde fayda vardır. Şarj ederken şarj süresinin 8 saat olmasından dolayı, gece yatarken mümkün olduğunda prizde bırakmamanız hem sizin sağlığınız için hem de powerbank sağlığı için çok önemlidir','redmi_20000_mah_ta____nabilir_h__zl_____arj_cihaz___-_usb-c_-_18w_2_____k____l___powerbank_-_siyah_1755530010',123459,'2025-08-18 18:13:30',NULL,1),(1530,'EP-T4510X',11129,5,'EP-T4510X Type-C Süper Hızlı Şarj Cihazı 45W Siyah','Oldukça geniş bir ürün yelpazesinde kullanabileceğiniz süper hızlı şarj.\r\n\r\n45W şarj aleti ile Galaxy cihazınızın şarjını süper hızlı bir şekilde tam doldurabilirsiniz. Ayrıca kutu içeriğinde kullanışlı bir ekstra uzun 1,8 metre kabloya sahip olacaksınız.\r\n\r\nprapazar.com pazaryeri hepsiburada entegrasyonu\r\n\r\n* Şarj hızı cihaza göre farklılık gösterebilir.\r\n** SFC 2.0(45W) özelliğini Galaxy S20 Ultra, Note10+, Tab S7+ ve üstü modeller desteklemektedir. Daha sonra başka uyumlu cihazlar eklenecektir.\r\nEvrensel Uyumluluk\r\n\r\nKulaklıklardan tabletlere kadar oldukça geniş bir cihaz yelpazesini optimum hızda şarj edin ve cihazınızı süper hızlı şarj etmenin avantajını yaşayın.\r\n\r\nprapazar.com pazaryeri hepsiburada entegrasyonu\r\n\r\n* Cihaz türüne, kabloya ve diğer çevresel etkenlere bağlı olarak cihazlar uygun bir şekilde şarj olmayabilir.\r\nGüvenli ve istikrarlı olduğu kadar hızlı ve güçlü de olabilir.\r\n\r\nGalaxy cihazlarınıza hak ettikleri istikrarlı ve güvenli gücü sağlayın. Normal kullanım koşullarında bu şarj aleti aşırı akım, kısa devre, sıcaklık dalgalanmaları gibi pek çok tehlikeli duruma karşı koruma sağlar.\r\n\r\nprapazar.com pazaryeri hepsiburada entegrasyonu\r\n\r\n* Global test standartlarına göre kurum içinde test edilmiştir. TÜV SÜD veya CTK Kore tarafından 01.10.2021 ve 31.10.2021 tarihleri arasında bağımsız olarak değerlendirilmiştir.\r\n** Bu 45W adaptör, ürünün satıldığı her bir ülkedeki ilgili kurum tarafından sertifikalandırılmıştır.\r\n*** Her bir ülkedeki test ekipmanı veya yönetmelikler hakkında daha fazla bilgi almak için lütfen Samsung.com adresindeki Bizimle İletişime Geçin sayfasını ziyaret edin.\r\n\r\n**** Kablo ile birlikte gelmektedir.','ep-t4510x_type-c_s__per_h__zl_____arj_cihaz___45w_siyah_1755549382',123459,'2025-08-18 23:36:22',NULL,1),(1531,'MD3J4TU/A',11129,6,'20 W USB-C Güç Adaptörü - MD3J4TU/A (Apple Türkiye Garantili)','Apple 20 W USB-C Güç Adaptörü - MD3J4TU/A (Apple Türkiye Garantili)\n\nApple 20 W USB-C Güç Adaptörü - MD3J4TU/A (Apple Türkiye Garantili)\nApple.com üzerinden garanti sorgusu sadece cihazlar için yapılabilir. (iPhone, iPad, Macbook, Watch, Airpods vb.)\nAdaptör, kablo, kablolu kulaklık, kılıf gibi aksesuar ürünlerinde garanti sorgusu yapılamaz, teknik servislerden kontrol ettirilebilir.\n\nApple 20 W USB-C Güç adaptörü, aygıtınızı evde, ofiste veya yolda hızlı ve verimli bir şekilde şarj etme imkanı sunar. Bu güç adaptörü, USB-C özellikli tüm aygıtlarla uyumludur. Ancak Apple, optimum şarj performansı için bu adaptörü iPad Pro ve iPad Air ile birlikte kullanmanızı önerir. Hızlı şarj özelliğinden yararlanmak için bu adaptörü iPhone 8 veya daha yeni model bir iPhone ile de kullanabilirsiniz.\nŞarj kablosu ayrı satılır.\niPhone 11, iPhone 12, iPhone 13, iPhone 14, iPhone 15, iPhone 16 uyumludur.','iphone_13_i__in_orjinal_g_____adapt__r___20w_1755549751',123459,'2025-08-18 23:42:31',NULL,1),(1532,'125079840',11126,5,'Galaxy S25 Plus 256 GB Buz Mavisi Cep Telefonu','Samsung S25 Plus Genel Özellikleri\r\nSamsung Galaxy S25 Plus, performans ve özellikler bakımından güçlü bir amiral gemisi modelidir. 6.7 inçlik ekranı, 1440x3120 piksel çözünürlükle üstün bir görsel deneyim sunar. QHD+ çözünürlük, yüksek renk doğruluğu ve keskinlik sağlar. 12 GB RAM ve 256 GB dahili depolama, çoklu görevlerde yüksek hız ve geniş depolama alanı sunar. 4900 mAh batarya kapasitesi, uzun süreli kullanım imkanı tanırken, 45W hızlı şarj desteğiyle kısa süre içinde hızlıca şarj edilebilir. 5G ve 4.5G desteği sayesinde hızlı internet bağlantısı sağlar. Samsung S25 Plus, IPX8 suya ve IP6X toza dayanıklılık sertifikalarına sahip olup, zorlu koşullarda da dayanıklıdır. 4.32 GHz hızında çalışan 8 çekirdekli işlemcisi ile yüksek performans sağlar. 50 MP çözünürlüğündeki ana kamera, net ve kaliteli fotoğraflar sunarken, 2x kayıpsız yakınlaştırma özelliği ile uzak mesafelerde bile net görüntüler elde edebilirsiniz. Parmak izi okuyucu, ekranın içinde yer alır ve hızlı bir güvenlik çözümü sunar. Ayrıca, USB Type-C bağlantısı ses çıkışı desteği ile pratiklik sağlar. Samsung Galaxy S25 Plus, hem güçlü donanımı hem de dayanıklı yapısıyla, günlük kullanımda ve daha zorlu koşullarda yüksek performans gösteren bir cihazdır.','galaxy_s25_plus_256_gb_buz_mavisi_1757332157',123456,'2025-09-08 14:49:17',NULL,1);
