DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `address_add`(
    IN p_user_id INT,
    IN p_first_name VARCHAR(50),
    IN p_last_name VARCHAR(50),
    IN p_neighborhood_id INT,
    IN p_district_id INT,
    IN p_province_id INT,
    IN p_phone_number VARCHAR(20),
    IN p_address_note VARCHAR(255),
    IN p_tax_or_national_id VARCHAR(50),
    IN p_tax_office VARCHAR(100),
    IN p_company_name VARCHAR(100),
    IN p_is_einvoice BOOLEAN
)
BEGIN
    DECLARE v_exists INT DEFAULT 0;
    DECLARE v_prev_count INT DEFAULT 0;
    DECLARE v_is_first TINYINT(1) DEFAULT 0;
    DECLARE v_address_type TINYINT(1);
    DECLARE v_new_address_id INT;
    DECLARE cleaned_phone_number VARCHAR(20);

    -- Bölge tutarlılık kontrolü
    SELECT COUNT(*)
      INTO v_exists
      FROM address_neighborhood_tb an
      JOIN address_district_tb  ad ON an.district_id = ad.district_id
      JOIN address_province_tb  ap ON ad.province_id = ap.province_id
     WHERE an.neighborhood_id = p_neighborhood_id
       AND ad.district_id      = p_district_id
       AND ap.province_id      = p_province_id;

    IF v_exists = 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid neighborhood, district, or province combination!';
    ELSE
        -- insert ÖNCESİ mevcut adres sayısı
        SELECT COUNT(*) INTO v_prev_count
          FROM user_address
         WHERE user_id = p_user_id;

        SET v_is_first = IF(v_prev_count = 0, 1, 0);

        -- tip ve telefon temizliği
        SET v_address_type = IF(p_tax_or_national_id IS NOT NULL AND p_tax_or_national_id <> '', 1, 0);

        SET cleaned_phone_number = TRIM(p_phone_number);
        -- önde '0 ' (sıfır ve boşluk) varsa kaldır (senin eski mantık sadeleştirilmiş)
        IF LEFT(cleaned_phone_number, 2) = '0 ' THEN
            SET cleaned_phone_number = SUBSTRING(cleaned_phone_number, 3);
        END IF;

        -- ekle
        INSERT INTO user_address (
            user_id, user_firstname, user_lastname, neighborhood_id, user_address_note, user_address_phone,
            user_address_type, user_address_taxornationalid, user_address_tax_office, user_address_company_name,
            user_address_einvoice_taxpayer, user_address_created_at
        ) VALUES (
            p_user_id, p_first_name, p_last_name, p_neighborhood_id, p_address_note, cleaned_phone_number,
            v_address_type, p_tax_or_national_id, p_tax_office, p_company_name,
            p_is_einvoice, NOW()
        );

        SET v_new_address_id = LAST_INSERT_ID();

        -- ilk adres ise veritabanında default/selected ayarla
        IF v_is_first = 1 THEN
            -- ÖNEMLİ: user_savedselectedaddress içinde SELECT olmamalı (yoksa fazladan result set üretir)
            CALL address_user_selected(p_user_id, v_new_address_id, 0);
        END IF;

        -- TEK ve SON çıktı: frontend bunu okuyacak
        SELECT 'success' AS status, v_new_address_id AS address_id, v_is_first AS is_first;
    END IF;
END ;;
DELIMITER ;
