DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `address_user_selected`(
    IN p_user_id INT, 
    IN p_user_address_id INT,
    IN p_user_billing_id INT
)
BEGIN
    DECLARE existing_record_count INT;
    DECLARE user_exists INT;
    DECLARE main_address_valid INT;
    DECLARE billing_address_valid INT;

    -- Check if the user exists
    SELECT COUNT(*) INTO user_exists
    FROM user_tb
    WHERE user_id = p_user_id;

    IF user_exists = 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'User does not exist';
    END IF;

    -- If delivery address is provided, check if it belongs to the user
    IF p_user_address_id > 0 THEN
        SELECT COUNT(*) INTO main_address_valid
        FROM user_address
        WHERE user_id = p_user_id AND user_address_id = p_user_address_id;

        IF main_address_valid = 0 THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Selected delivery address does not belong to the user';
        END IF;
    END IF;

    -- If billing address is provided, check if it belongs to the user
    IF p_user_billing_id > 0 THEN
        SELECT COUNT(*) INTO billing_address_valid
        FROM user_address
        WHERE user_id = p_user_id AND user_address_id = p_user_billing_id;

        IF billing_address_valid = 0 THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Selected billing address does not belong to the user';
        END IF;
    END IF;

    -- Check if user already has a selected address
    SELECT COUNT(*) INTO existing_record_count
    FROM user_selected_address usa
    JOIN user_address ua ON usa.user_address_id = ua.user_address_id
    WHERE ua.user_id = p_user_id;

    IF existing_record_count > 0 THEN
        -- Update only the fields that are >0
        IF p_user_address_id > 0 THEN
            UPDATE user_selected_address usa
            JOIN user_address ua ON usa.user_address_id = ua.user_address_id
            SET 
                usa.user_address_id = p_user_address_id,
                usa.last_updated_at = NOW()
            WHERE ua.user_id = p_user_id;
        END IF;

        IF p_user_billing_id > 0 THEN
            UPDATE user_selected_address usa
            JOIN user_address ua ON usa.user_address_id = ua.user_address_id
            SET 
                usa.user_billing_address_id = p_user_billing_id,
                usa.last_updated_at = NOW()
            WHERE ua.user_id = p_user_id;
        END IF;
    ELSE
        -- Insert a new selected address
        INSERT INTO user_selected_address (user_address_id, user_billing_address_id, created_at)
        VALUES (
            CASE WHEN p_user_address_id > 0 THEN p_user_address_id ELSE NULL END,
            CASE WHEN p_user_billing_id > 0 THEN p_user_billing_id ELSE NULL END,
            NOW()
        );
    END IF;
END ;;
DELIMITER ;
