CREATE DEFINER=`root`@`localhost` PROCEDURE `add_brand`(
    IN p_brand_name VARCHAR(255),
    IN p_category_id INT
)
BEGIN
    DECLARE category_exists INT;
    DECLARE brand_exists INT;

    -- Check if category exists
    SELECT COUNT(*) INTO category_exists
    FROM product_categorys_tb
    WHERE category_id = p_category_id;

    IF category_exists = 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid category_id: does not exist.';
    END IF;

    -- Check if brand already exists in this category
    SELECT COUNT(*) INTO brand_exists
    FROM product_brand_tb
    WHERE brand_name = p_brand_name AND category_id = p_category_id;

    IF brand_exists > 0 THEN
        SIGNAL SQLSTATE '45001'
        SET MESSAGE_TEXT = 'Brand already exists in this category.';
    END IF;

    -- Insert brand
    INSERT INTO product_brand_tb (
        brand_name,
        category_id,
        brand_created_at,
        brand_status
    )
    VALUES (
        p_brand_name,
        p_category_id,
        NOW(),
        1
    );
END ;;
DELIMITER ;
