CREATE DEFINER=`root`@`localhost` PROCEDURE `add_category_auto`(
  IN  in_category                VARCHAR(255),
  IN  in_sub_category            VARCHAR(255),
  IN  in_tertiary_category_name  VARCHAR(255),
  OUT out_category_id            INT,
  OUT out_sub_category_id        INT,
  OUT out_tertiary_category_id   INT,
  OUT out_message                VARCHAR(255)
)
BEGIN
  DECLARE tmp_id INT;
  DECLARE inserted_anything BOOL DEFAULT FALSE;

  -- 1. RESOLVE OR INSERT CATEGORY
  IF in_category = '' THEN
    SET out_category_id = NULL;
  ELSEIF in_category REGEXP '^[0-9]+$' THEN
    SET out_category_id = CAST(in_category AS UNSIGNED);
  ELSE
    SELECT category_id INTO tmp_id
    FROM product_categorys_tb
    WHERE category_name = in_category AND product_categorys_status = 1
    LIMIT 1;

    IF tmp_id IS NOT NULL THEN
      SET out_category_id = tmp_id;
    ELSE
      INSERT INTO product_categorys_tb (category_name, category_created_at, product_categorys_status)
      VALUES (in_category, NOW(), 1);
      SET out_category_id = LAST_INSERT_ID();
      SET inserted_anything = TRUE;
    END IF;
  END IF;

  -- 2. RESOLVE OR INSERT SUBCATEGORY
  IF in_sub_category = '' THEN
    SET out_sub_category_id = NULL;
  ELSEIF in_sub_category REGEXP '^[0-9]+$' THEN
    SET out_sub_category_id = CAST(in_sub_category AS UNSIGNED);
  ELSE
    IF out_category_id IS NOT NULL THEN
      SELECT product_sub_category_id INTO tmp_id
      FROM product_sub_category_tb
      WHERE product_sub_category_name = in_sub_category
        AND product_category_id = out_category_id
        AND product_sub_category_status = 1
      LIMIT 1;

      IF tmp_id IS NOT NULL THEN
        SET out_sub_category_id = tmp_id;
      ELSE
        INSERT INTO product_sub_category_tb (
          product_sub_category_name,
          product_category_id,
          product_sub_category_created_at,
          product_sub_category_status
        )
        VALUES (
          in_sub_category,
          out_category_id,
          NOW(),
          1);
        SET out_sub_category_id = LAST_INSERT_ID();
        SET inserted_anything = TRUE;
      END IF;
    ELSE
      SET out_sub_category_id = NULL;
    END IF;
  END IF;

  -- 3. RESOLVE OR INSERT TERTIARY CATEGORY
  IF in_tertiary_category_name = '' THEN
    SET out_tertiary_category_id = NULL;
  ELSEIF in_tertiary_category_name REGEXP '^[0-9]+$' THEN
    SET out_tertiary_category_id = CAST(in_tertiary_category_name AS UNSIGNED);
  ELSE
    IF out_sub_category_id IS NOT NULL THEN
      SELECT product_tertiary_category_id INTO tmp_id
      FROM product_tertiary_category_tb
      WHERE product_tertiary_category_name = in_tertiary_category_name
        AND product_sub_category_id = out_sub_category_id
        AND product_tertiary_category_status = 1
      LIMIT 1;

      IF tmp_id IS NOT NULL THEN
        SET out_tertiary_category_id = tmp_id;
      ELSE
        INSERT INTO product_tertiary_category_tb (
          product_tertiary_category_name,
          product_sub_category_id,
          product_tertiary_category_created_at,
          product_tertiary_category_status
        )
        VALUES (
          in_tertiary_category_name,
          out_sub_category_id,
          NOW(),
          1);
        SET out_tertiary_category_id = LAST_INSERT_ID();
        SET inserted_anything = TRUE;
      END IF;
    ELSE
      SET out_tertiary_category_id = NULL;
    END IF;
  END IF;

  -- FINAL MESSAGE
  IF inserted_anything THEN
    SET out_message = 'Inserted new data';
  ELSE
    SET out_message = 'Nothing was added';
  END IF;
END ;;
DELIMITER ;
