CREATE DEFINER=`root`@`localhost` PROCEDURE `add_product_price`(
    IN p_product_id INT,
    IN p_admin_id INT,
    IN p_product_price DECIMAL(10,2),
    IN p_product_quantity INT,
    IN p_product_type INT
)
proc_block: BEGIN

  DECLARE category_from_product INT;
  DECLARE is_valid_type BOOL DEFAULT TRUE;
  DECLARE existing_price_id INT;

  -- Failsafe: prevent null type
  IF p_product_type IS NULL THEN
    SET p_product_type = 0;
  END IF;

  -- Validate product type if given
  IF p_product_type != 0 THEN
    SELECT c.category_id INTO category_from_product
    FROM products_tb p
    JOIN product_tertiary_category_tb ptet 
         ON p.product_tetcategory = ptet.product_tertiary_category_id
    JOIN product_sub_category_tb psub 
         ON ptet.product_sub_category_id = psub.product_sub_category_id
    JOIN product_categorys_tb c 
         ON psub.product_category_id = c.category_id
    WHERE p.product_id = p_product_id
    LIMIT 1;

    IF NOT EXISTS (
      SELECT 1 
      FROM product_types_tb
      WHERE type_id = p_product_type
        AND category_id = category_from_product
    ) THEN
      SET is_valid_type = FALSE;
    END IF;
  END IF;

  IF is_valid_type = FALSE THEN
    SIGNAL SQLSTATE '45000'
    SET MESSAGE_TEXT = 'Type does not belong to product’s category';
  END IF;

  --  Restriction: prevent mixing typed vs non-typed prices
  IF p_product_type = 0 THEN
    -- If product already has any typed price, reject
    IF EXISTS (
      SELECT 1
      FROM product_prices_tb
      WHERE product_id = p_product_id
        AND admin_id = p_admin_id
        AND product_type IS NOT NULL
        AND product_type != 0
      LIMIT 1
    ) THEN
      SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'This product already has typed prices; cannot add a non-typed price.';
    END IF;
  ELSE
    -- If product already has a non-type price, reject
    IF EXISTS (
      SELECT 1
      FROM product_prices_tb
      WHERE product_id = p_product_id
        AND admin_id = p_admin_id
        AND (product_type IS NULL OR product_type = 0)
      LIMIT 1
    ) THEN
      SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'This product already has a non-typed price; cannot add a typed price.';
    END IF;
  END IF;

  -- Check if a price entry already exists for this product/admin/type
  SELECT price_id INTO existing_price_id
  FROM product_prices_tb
  WHERE product_id = p_product_id
    AND admin_id = p_admin_id
    AND product_type = p_product_type
  LIMIT 1;

  IF existing_price_id IS NOT NULL THEN
    -- Update existing record with new price and quantity
    UPDATE product_prices_tb
    SET product_price    = p_product_price,
        product_quantity = p_product_quantity,
        updated_at       = NOW()
    WHERE price_id = existing_price_id;

    LEAVE proc_block;
  END IF;

  -- If no existing record, insert new
  INSERT INTO product_prices_tb (
    product_id,
    admin_id,
    product_price,
    product_quantity,
    product_type,
    created_at
  ) VALUES (
    p_product_id,
    p_admin_id,
    p_product_price,
    p_product_quantity,
    p_product_type,
    NOW()
  );

END ;;
DELIMITER ;
