CREATE DEFINER=`root`@`localhost` PROCEDURE `categorys_show`()
BEGIN
  -- 1) Categories
  SELECT 
    c.category_id,
    c.category_name,
    c.category_created_at,
    c.product_categorys_status
  FROM mysqltestdb.product_categorys_tb AS c
  ORDER BY c.category_id;

  -- 2) Subcategories
  SELECT 
    sc.product_sub_category_id,
    sc.product_sub_category_name,
    sc.product_category_id,
    sc.product_sub_category_created_at,
    sc.product_sub_category_status
  FROM mysqltestdb.product_sub_category_tb AS sc
  ORDER BY sc.product_sub_category_name;

  -- 3) Tertiary categories
  SELECT
    tc.product_tertiary_category_id,
    tc.product_tertiary_category_name,
    tc.product_sub_category_id,
    tc.product_tertiary_category_created_at,
    tc.product_tertiary_category_status
  FROM mysqltestdb.product_tertiary_category_tb AS tc
  ORDER BY tc.product_tertiary_category_name;
END ;;
