CREATE DEFINER=`root`@`localhost` PROCEDURE `coupons_get_applicable_user`(
    IN p_user_id INT
)
BEGIN
  /*
    Return coupons saved by the user that are valid by date AND applicable via:
      A) applies_to_all_products = 1  AND user has any active cart row
      B) product mapping (coupon_product_tb) AND that product is in the cart
      C) tertiary mapping (coupon_category_tb.tertiary_category_id) to product_tetcategory
      D) subcategory mapping:
           p.product_tetcategory -> product_tertiary_category_tb.product_sub_category_id
         matched to coupon_category_tb.subcategory_id
      E) category mapping:
           p.product_tetcategory -> product_tertiary_category_tb.product_sub_category_id
           -> product_sub_category_tb.product_category_id
         matched to coupon_category_tb.category_id
  */

  SELECT DISTINCT
      c.coupon_id,
      c.coupon_code,
      c.discount_amount,
      c.end_date,
      CASE WHEN ca.coupon_id IS NOT NULL THEN 1 ELSE 0 END AS is_active
  FROM coupon_user_storage_tb ucs
  JOIN coupons_tb c
    ON c.coupon_id = ucs.coupon_id
   AND (c.start_date IS NULL OR c.start_date <= CURRENT_DATE())
   AND (c.end_date   IS NULL OR c.end_date   >= CURRENT_DATE())
  LEFT JOIN coupon_active_tb ca
    ON ca.user_id = ucs.user_id
   AND ca.coupon_id = c.coupon_id
  WHERE ucs.user_id = p_user_id
    AND (
      /* A) applies to all products */
      (
        c.applies_to_all_products = 1
        AND EXISTS (
          SELECT 1
          FROM shoppingcart_tb sc
          WHERE sc.user_id = p_user_id
            AND sc.cart_status = 1
        )
      )

      /* B) product-based mapping */
      OR EXISTS (
        SELECT 1
        FROM coupon_product_tb cp
        JOIN shoppingcart_tb sc
          ON sc.product_id  = cp.product_id
         AND sc.user_id     = p_user_id
         AND sc.cart_status = 1
        WHERE cp.coupon_id = c.coupon_id
      )

      /* C) tertiary-based mapping: cc.tertiary_category_id -> p.product_tetcategory */
      OR EXISTS (
        SELECT 1
        FROM coupon_category_tb cc
        JOIN products_tb p
          ON p.product_tetcategory = cc.tertiary_category_id
        JOIN shoppingcart_tb sc
          ON sc.product_id  = p.product_id
         AND sc.user_id     = p_user_id
         AND sc.cart_status = 1
        WHERE cc.coupon_id = c.coupon_id
          AND cc.tertiary_category_id IS NOT NULL
      )

      /* D) subcategory-based mapping:
            p.product_tetcategory -> product_tertiary_category_tb.product_sub_category_id
            matched to cc.subcategory_id
      */
      OR EXISTS (
        SELECT 1
        FROM coupon_category_tb cc
        JOIN products_tb p
          ON 1=1
        JOIN product_tertiary_category_tb t
          ON t.product_tertiary_category_id = p.product_tetcategory
        JOIN shoppingcart_tb sc
          ON sc.product_id  = p.product_id
         AND sc.user_id     = p_user_id
         AND sc.cart_status = 1
        WHERE cc.coupon_id = c.coupon_id
          AND cc.subcategory_id IS NOT NULL
          AND t.product_sub_category_id = cc.subcategory_id
      )

      /* E) category-based mapping:
            p.product_tetcategory -> t.product_sub_category_id
            -> s.product_category_id matched to cc.category_id
      */
      OR EXISTS (
        SELECT 1
        FROM coupon_category_tb cc
        JOIN products_tb p
          ON 1=1
        JOIN product_tertiary_category_tb t
          ON t.product_tertiary_category_id = p.product_tetcategory
        JOIN product_sub_category_tb s
          ON s.product_sub_category_id = t.product_sub_category_id
        JOIN shoppingcart_tb sc
          ON sc.product_id  = p.product_id
         AND sc.user_id     = p_user_id
         AND sc.cart_status = 1
        WHERE cc.coupon_id = c.coupon_id
          AND cc.category_id IS NOT NULL
          AND s.product_category_id = cc.category_id
      )
    );
END ;;
DELIMITER ;
