CREATE DEFINER=`root`@`localhost` PROCEDURE `coupon_active_set`(
    IN p_user_id INT,
    IN p_coupon_code VARCHAR(100),
    IN p_coupon_id INT
)
BEGIN
    DECLARE v_coupon_id INT DEFAULT NULL;
    DECLARE v_valid INT DEFAULT 0;
    DECLARE v_message VARCHAR(255);

    -- 1. Find coupon by id or code
    IF p_coupon_id IS NOT NULL AND p_coupon_id > 0 THEN
        SET v_coupon_id = p_coupon_id;
    ELSE
        SELECT coupon_id
        INTO v_coupon_id
        FROM coupons_tb
        WHERE coupon_code = p_coupon_code
          AND (end_date IS NULL OR end_date >= CURRENT_DATE())
        LIMIT 1;
    END IF;

    -- 2. Validate applicability
    IF v_coupon_id IS NOT NULL THEN

        -- (a) Applies to all
        IF EXISTS (
            SELECT 1
            FROM coupons_tb c
            WHERE c.coupon_id = v_coupon_id
              AND c.applies_to_all_products = 1
        ) THEN
            SET v_valid = 1;
        END IF;

        -- (b) Product match
        IF v_valid = 0 AND EXISTS (
            SELECT 1
            FROM shoppingcart_tb sc
            JOIN coupon_product_tb cp ON cp.product_id = sc.product_id
            WHERE sc.user_id = p_user_id
              AND sc.cart_status = 1
              AND cp.coupon_id = v_coupon_id
        ) THEN
            SET v_valid = 1;
        END IF;

        -- (c) Tertiary match
        IF v_valid = 0 AND EXISTS (
            SELECT 1
            FROM shoppingcart_tb sc
            JOIN products_tb p ON p.product_id = sc.product_id
            JOIN coupon_category_tb cc 
                  ON cc.tertiary_category_id = p.product_tetcategory
            WHERE sc.user_id = p_user_id
              AND sc.cart_status = 1
              AND cc.coupon_id = v_coupon_id
        ) THEN
            SET v_valid = 1;
        END IF;

        -- (d) Subcategory match
        IF v_valid = 0 AND EXISTS (
            SELECT 1
            FROM shoppingcart_tb sc
            JOIN products_tb p ON p.product_id = sc.product_id
            JOIN product_tertiary_category_tb ptc ON ptc.product_tertiary_category_id = p.product_tetcategory
            JOIN coupon_category_tb cc 
                  ON cc.subcategory_id = ptc.product_sub_category_id
            WHERE sc.user_id = p_user_id
              AND sc.cart_status = 1
              AND cc.coupon_id = v_coupon_id
        ) THEN
            SET v_valid = 1;
        END IF;

        -- (e) Category match
        IF v_valid = 0 AND EXISTS (
            SELECT 1
            FROM shoppingcart_tb sc
            JOIN products_tb p ON p.product_id = sc.product_id
            JOIN product_tertiary_category_tb ptc ON ptc.product_tertiary_category_id = p.product_tetcategory
            JOIN product_sub_category_tb psc ON psc.product_sub_category_id = ptc.product_sub_category_id
            JOIN coupon_category_tb cc 
                  ON cc.category_id = psc.product_category_id
            WHERE sc.user_id = p_user_id
              AND sc.cart_status = 1
              AND cc.coupon_id = v_coupon_id
        ) THEN
            SET v_valid = 1;
        END IF;

    END IF;

    -- 3. Apply coupon if valid
    IF v_valid = 1 THEN
        IF EXISTS (SELECT 1 FROM coupon_active_tb WHERE user_id = p_user_id) THEN
            UPDATE coupon_active_tb
            SET coupon_id = v_coupon_id, applied_at = NOW()
            WHERE user_id = p_user_id;
        ELSE
            INSERT INTO coupon_active_tb(user_id, coupon_id, applied_at)
            VALUES (p_user_id, v_coupon_id, NOW());
        END IF;

        SET v_message = '✅ Coupon applied successfully.';
    ELSE
        SET v_message = '❌ Invalid or inapplicable coupon.';
    END IF;

    -- 4. Return result
    SELECT v_coupon_id AS coupon_id, v_message AS message;
END ;;
DELIMITER ;
