CREATE DEFINER=`root`@`localhost` PROCEDURE `coupon_add`(
    IN in_code VARCHAR(50),
    IN in_discount_amount DECIMAL(10,2),
    IN in_expiration_days INT,
    IN in_category_id INT,
    IN in_subcategory_id INT,
    IN in_tertiary_category_id INT,
    IN in_product_id INT,
    IN in_user_id INT  -- ✅ optional user assignment
)
BEGIN
    DECLARE new_coupon_id INT;

    -- Step 1: Insert main coupon
    INSERT INTO coupons_tb (coupon_code, discount_amount, start_date, end_date)
    VALUES (
        in_code,
        in_discount_amount,
        CURDATE(),
        DATE_ADD(CURDATE(), INTERVAL in_expiration_days DAY)
    );

    SET new_coupon_id = LAST_INSERT_ID();

    -- Step 2: Link to category/sub/tertiary if provided
    IF in_category_id IS NOT NULL OR in_subcategory_id IS NOT NULL OR in_tertiary_category_id IS NOT NULL THEN
        INSERT INTO coupon_category_tb (coupon_id, category_id, subcategory_id, tertiary_category_id)
        VALUES (new_coupon_id, in_category_id, in_subcategory_id, in_tertiary_category_id);
    END IF;

    -- Step 3: Link to a product if provided
    IF in_product_id IS NOT NULL THEN
        INSERT INTO coupon_product_tb (coupon_id, product_id)
        VALUES (new_coupon_id, in_product_id);
    END IF;

    -- ✅ Step 4: Assign to a specific user if provided
    IF in_user_id IS NOT NULL THEN
        INSERT INTO coupon_user_tb (coupon_id, user_id, is_used)
        VALUES (new_coupon_id, in_user_id, 0);
    END IF;

    -- Final response
    SELECT new_coupon_id AS coupon_id, '✅ Coupon added successfully.' AS message;
END ;;
DELIMITER ;
