CREATE DEFINER=`root`@`localhost` PROCEDURE `coupon_add_to_user_storage`(
    IN p_user_id INT,
    IN p_coupon_id INT
)
BEGIN
    -- Prevent duplicates
    IF NOT EXISTS (
        SELECT 1 FROM coupon_user_storage_tb 
        WHERE user_id = p_user_id AND coupon_id = p_coupon_id
    ) THEN
        INSERT INTO coupon_user_storage_tb (user_id, coupon_id)
        VALUES (p_user_id, p_coupon_id);
    END IF;
END ;;
