CREATE DEFINER=`root`@`localhost` PROCEDURE `coupon_available`(
    IN p_user_id INT
)
BEGIN
    SELECT DISTINCT
        c.coupon_id,
        c.coupon_code,
        c.discount_amount,
        c.start_date,
        c.end_date,

        -- Target assignment (which level the coupon applies to)
        CASE 
            WHEN cc.category_id IS NOT NULL THEN 'Category'
            WHEN cc.subcategory_id IS NOT NULL THEN 'Subcategory'
            WHEN cc.tertiary_category_id IS NOT NULL THEN 'Tertiary'
            WHEN cp.product_id IS NOT NULL THEN 'Product'
            ELSE 'All Products'
        END AS target_type,

        -- Target name to show user (category/subcategory/tertiary/product)
        COALESCE(
            cat.category_name,
            sub.product_sub_category_name,
            ter.product_tertiary_category_name,
            p.product_name,
            'All'
        ) AS target_name

    FROM coupons_tb c

    -- Category-level targeting
    LEFT JOIN coupon_category_tb cc 
           ON cc.coupon_id = c.coupon_id
    LEFT JOIN product_categorys_tb cat 
           ON cat.category_id = cc.category_id
    LEFT JOIN product_sub_category_tb sub 
           ON sub.product_sub_category_id = cc.subcategory_id
    LEFT JOIN product_tertiary_category_tb ter 
           ON ter.product_tertiary_category_id = cc.tertiary_category_id

    -- Product-level targeting
    LEFT JOIN coupon_product_tb cp 
           ON cp.coupon_id = c.coupon_id
    LEFT JOIN products_tb p 
           ON p.product_id = cp.product_id

    --  Used coupons (exclude if record exists for user)
    LEFT JOIN coupon_user_tb cu_used
           ON cu_used.coupon_id = c.coupon_id
          AND cu_used.user_id = p_user_id

    WHERE (c.end_date IS NULL OR c.end_date >= CURRENT_DATE())
      -- if user_id = 0 → show only general coupons
      AND (
            (p_user_id = 0 AND cu_used.coupon_id IS NULL)
         OR (p_user_id > 0 AND cu_used.coupon_id IS NULL)
      )
    ORDER BY c.start_date DESC;
END ;;
DELIMITER ;
