CREATE DEFINER=`root`@`localhost` PROCEDURE `coupon_show_for_product`(
    IN in_product_id INT
)
BEGIN
    DECLARE cat_id INT;
    DECLARE sub_id INT;
    DECLARE ter_id INT;

    -- Get product's category data
    SELECT 
        c.category_id,
        sc.product_sub_category_id,
        tc.product_tertiary_category_id
    INTO cat_id, sub_id, ter_id
    FROM products_tb p
    LEFT JOIN product_tertiary_category_tb tc ON tc.product_tertiary_category_id = p.product_tetcategory
    LEFT JOIN product_sub_category_tb sc ON sc.product_sub_category_id = tc.product_sub_category_id
    LEFT JOIN product_categorys_tb c ON c.category_id = sc.product_category_id
    WHERE p.product_id = in_product_id;

    -- Return matching coupons
    SELECT 
        c.coupon_id,
        c.coupon_code,
        c.discount_amount,
        c.end_date,
        'Matched' AS reason
    FROM coupons_tb c
    LEFT JOIN coupon_product_tb cp ON cp.coupon_id = c.coupon_id
    LEFT JOIN coupon_category_tb cc ON cc.coupon_id = c.coupon_id
    WHERE
        (c.end_date IS NULL OR c.end_date >= CURRENT_DATE())
        AND (
            cp.product_id = in_product_id
            OR cc.tertiary_category_id = ter_id
            OR cc.subcategory_id = sub_id
            OR cc.category_id = cat_id
            OR (cp.product_id IS NULL AND cc.category_id IS NULL AND cc.subcategory_id IS NULL AND cc.tertiary_category_id IS NULL)
        )
    GROUP BY c.coupon_id
    ORDER BY c.start_date DESC;
END ;;
DELIMITER ;
