CREATE DEFINER=`root`@`localhost` PROCEDURE `favorites_show`(IN p_user_id INT)
BEGIN
    -- 1. Favorited product info
SELECT 
    f.product_id,
    p.product_name,
    p.product_desc,
    p.product_link,
    b.brand_id,
    b.brand_name,
    pp_min.lowest_price,
    pp.product_discount_price as original_price,
    pp.admin_id,             -- ✅ Seller (admin) offering the lowest price
    1 AS is_favorite
FROM product_favorites_tb f
JOIN products_tb p ON f.product_id = p.product_id
LEFT JOIN product_brand_tb b ON p.product_brand_id = b.brand_id

-- 1. Get lowest price per product
LEFT JOIN (
    SELECT product_id, MIN(product_price) AS lowest_price
    FROM product_prices_tb
    GROUP BY product_id
) pp_min ON pp_min.product_id = p.product_id

-- 2. Join again to get the admin who owns that price
LEFT JOIN product_prices_tb pp ON pp.product_id = pp_min.product_id AND pp.product_price = pp_min.lowest_price

WHERE f.user_id = p_user_id
  AND p.product_status = 1;



    -- 2. Images for favorited products
    SELECT 
        i.product_id,
        i.image_filename,
        i.display_order
    FROM product_images_tb i
    WHERE i.product_id IN (
        SELECT f.product_id
        FROM product_favorites_tb f
        JOIN products_tb p ON f.product_id = p.product_id
        WHERE f.user_id = p_user_id AND p.product_status = 1
    )
    ORDER BY i.product_id, i.display_order;

    -- 3. Reviews: count and average rating for each product
    SELECT 
        p.product_id,
        COUNT(r.review_id) AS review_count,
        ROUND(AVG(r.rating), 1) AS average_rating
    FROM products_tb p
    LEFT JOIN order_detail_tb od ON od.product_id = p.product_id
    LEFT JOIN product_review_tb r ON r.order_detail_id = od.order_detail_id
    WHERE p.product_id IN (
        SELECT f.product_id
        FROM product_favorites_tb f
        JOIN products_tb p ON f.product_id = p.product_id
        WHERE f.user_id = p_user_id AND p.product_status = 1
    )
    GROUP BY p.product_id;
END ;;
DELIMITER ;
