CREATE DEFINER=`root`@`localhost` PROCEDURE `favorite_toggle`(
    IN p_user_id INT,
    IN p_product_id INT
)
BEGIN
    DECLARE existing_favorite INT;

    -- Check if the product is already in the user's favorites
    SELECT COUNT(*) INTO existing_favorite
    FROM product_favorites_tb
    WHERE user_id = p_user_id AND product_id = p_product_id;

    IF existing_favorite = 0 THEN
        -- Add the product to favorites if not already added
        INSERT INTO product_favorites_tb (user_id, product_id, created_at)
        VALUES (p_user_id, p_product_id, NOW());
    ELSE
        -- Remove the product from favorites if already added
        DELETE FROM product_favorites_tb
        WHERE user_id = p_user_id AND product_id = p_product_id;
    END IF;
END ;;
