CREATE DEFINER=`root`@`localhost` PROCEDURE `get_category_suggestions`(
    IN p_type VARCHAR(20),
    IN p_query VARCHAR(255),
    IN p_parent_id INT
)
BEGIN
    IF p_type = 'category' THEN
        SELECT category_id AS id, category_name AS name
        FROM product_categorys_tb
        WHERE category_name LIKE CONCAT('%', p_query, '%')
        ORDER BY category_name ASC
        LIMIT 10;

    ELSEIF p_type = 'subcategory' THEN
        SELECT product_sub_category_id AS id, product_sub_category_name AS name
        FROM product_sub_category_tb
        WHERE (p_parent_id IS NULL OR product_category_id = p_parent_id)
          AND product_sub_category_name LIKE CONCAT('%', p_query, '%')
        ORDER BY product_sub_category_name ASC
        LIMIT 10;

    ELSEIF p_type = 'tertiary' THEN
        SELECT product_tertiary_category_id AS id, product_tertiary_category_name AS name
        FROM product_tertiary_category_tb
        WHERE (p_parent_id IS NULL OR product_sub_category_id = p_parent_id)
          AND product_tertiary_category_name LIKE CONCAT('%', p_query, '%')
        ORDER BY product_tertiary_category_name ASC
        LIMIT 10;
    END IF;
END ;;
