CREATE DEFINER=`root`@`localhost` PROCEDURE `order_list`(
  IN p_user_id INT,
  IN p_status  VARCHAR(20),   -- 'waiting' | 'shipped' | 'completed' | NULL = all
  IN p_query   VARCHAR(255)   -- optional: matches order_id or product_name
)
BEGIN
  DECLARE v_query VARCHAR(255);
  SET v_query = NULLIF(TRIM(p_query), '');

  /* latest status per order */
  /* You can index shipment_tb(order_id, created_at) for speed */

  /* ---------- Build filtered order set once ---------- */
  DROP TEMPORARY TABLE IF EXISTS tmp_filtered_orders;
  CREATE TEMPORARY TABLE tmp_filtered_orders AS
  SELECT 
    o.order_id,
    o.created_at,
    o.order_total_price,
    COALESCE(ls.shipping_status, 'waiting') AS shipping_status
  FROM order_tb o
  LEFT JOIN (
    SELECT order_id, shipping_status
    FROM (
      SELECT s.order_id, s.shipping_status, s.created_at,
             ROW_NUMBER() OVER (PARTITION BY s.order_id ORDER BY s.created_at DESC) AS rn
      FROM shipment_tb s
    ) x
    WHERE x.rn = 1
  ) ls ON ls.order_id = o.order_id
  WHERE o.user_id = p_user_id
    AND (
      p_status IS NULL OR p_status = '' OR
      COALESCE(ls.shipping_status, 'waiting') = p_status
    )
    AND (
      v_query IS NULL
      OR CAST(o.order_id AS CHAR) LIKE CONCAT('%', v_query, '%')
      OR EXISTS (
          SELECT 1
          FROM order_detail_tb od2
          JOIN products_tb p2 ON p2.product_id = od2.product_id
          WHERE od2.order_id = o.order_id
            AND p2.product_name LIKE CONCAT('%', v_query, '%')
      )
    )
  ORDER BY o.created_at DESC;

  /* ---------- 1) Orders list ---------- */
  SELECT 
    t.order_id,
    t.shipping_status,
    t.created_at,
    t.order_total_price,

    /* preview image (first image of first product) */
    (
      SELECT pi.image_filename
      FROM order_detail_tb od
      JOIN product_images_tb pi ON od.product_id = pi.product_id
      WHERE od.order_id = t.order_id
      ORDER BY od.product_id ASC, pi.display_order ASC
      LIMIT 1
    ) AS image_filename,

    (
      SELECT p.product_link
      FROM order_detail_tb od
      JOIN products_tb p ON od.product_id = p.product_id
      WHERE od.order_id = t.order_id
      ORDER BY od.product_id ASC
      LIMIT 1
    ) AS product_link

  FROM tmp_filtered_orders t
  ORDER BY t.created_at DESC;

  /* ---------- 2) Gallery images for the filtered orders ---------- */
  SELECT 
    od.order_id,
    pi.image_filename,
    p.product_link,
    pi.display_order
  FROM order_detail_tb od
  JOIN products_tb p        ON od.product_id = p.product_id
  JOIN product_images_tb pi ON p.product_id  = pi.product_id
  WHERE od.order_id IN (SELECT order_id FROM tmp_filtered_orders)
    AND pi.display_order <= 1
  ORDER BY od.order_id, od.product_id, pi.display_order
  LIMIT 100;

  /* ---------- 3) Badge counts (ALL orders; ignores p_status & p_query) ---------- */
  SELECT
    COUNT(*) AS all_cnt,
    SUM(CASE WHEN COALESCE(ls.shipping_status, 'waiting') = 'waiting'   THEN 1 ELSE 0 END) AS waiting_cnt,
    SUM(CASE WHEN COALESCE(ls.shipping_status, 'waiting') = 'shipped'   THEN 1 ELSE 0 END) AS shipped_cnt,
    SUM(CASE WHEN COALESCE(ls.shipping_status, 'waiting') = 'completed' THEN 1 ELSE 0 END) AS delivered_cnt
  FROM order_tb o
  LEFT JOIN (
    SELECT order_id, shipping_status
    FROM (
      SELECT s.order_id, s.shipping_status, s.created_at,
             ROW_NUMBER() OVER (PARTITION BY s.order_id ORDER BY s.created_at DESC) AS rn
      FROM shipment_tb s
    ) x
    WHERE x.rn = 1
  ) ls ON ls.order_id = o.order_id
  WHERE o.user_id = p_user_id;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
