/*!50003 DROP PROCEDURE IF EXISTS `products_admin_show` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `products_admin_show`(
    IN in_user_id INT,
    IN in_page_number INT,
    IN in_page_size INT
)
BEGIN
    DECLARE v_page INT DEFAULT IFNULL(in_page_number, 1);
    DECLARE v_size INT DEFAULT IFNULL(in_page_size, 10);
    DECLARE v_offset INT;

    IF v_page < 1 THEN SET v_page = 1; END IF;
    IF v_size < 1 THEN SET v_size = 10; END IF;
    IF v_size > 100 THEN SET v_size = 100; END IF;

    SET v_offset = (v_page - 1) * v_size;

    /* total rows = count of the joined/filtered result (not products only) */
    SELECT COUNT(*) AS total_rows
    FROM mysqltestdb.products_tb p
    JOIN product_prices_tb pp
         ON p.product_id = pp.product_id
        AND pp.admin_id  = in_user_id
    WHERE p.product_status = 1;
    -- If you only want typed rows, add: AND pp.product_type <> 0

    /* current page */
    SELECT 
        p.product_id,
        p.product_GTIN,
        p.product_tetcategory,
        CONCAT(COALESCE(b.brand_name, ''), ' ', p.product_name) AS product_name,
        p.product_desc,
        (
            SELECT ROUND(AVG(r.rating), 2)
            FROM product_review_tb r
            JOIN order_detail_tb od ON r.order_detail_id = od.order_detail_id
            WHERE od.product_id = p.product_id AND r.status = 1
        ) AS average_rating,
        pp.product_price,
        pp.product_quantity,
        pp.product_discount_price,
        pp.product_type,
        t.type_name,
        p.product_link,
        p.added_user_id,
        p.product_created_at,
        p.product_updated_at,
        p.product_status,
        i.image_id,
        i.image_filename,
        i.display_order,
        i.created_at AS image_created_at
    FROM mysqltestdb.products_tb p
    JOIN product_prices_tb pp
         ON p.product_id = pp.product_id
        AND pp.admin_id  = in_user_id
    LEFT JOIN product_types_tb t
           ON t.type_id = pp.product_type
    LEFT JOIN product_images_tb i
           ON p.product_id = i.product_id AND i.display_order = 1
    LEFT JOIN product_brand_tb b
           ON p.product_brand_id = b.brand_id
    WHERE p.product_status = 1
    ORDER BY p.product_created_at DESC, p.product_id DESC, t.type_name ASC
    LIMIT v_size OFFSET v_offset;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
