/*!50003 DROP PROCEDURE IF EXISTS `products_get_related` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `products_get_related`(
    IN in_product_id INT,
    IN in_user_id INT
)
BEGIN
    DECLARE in_tetcategory_id INT;

    -- Get the tertiary category of the input product
    SELECT product_tetcategory INTO in_tetcategory_id
    FROM products_tb
    WHERE product_id = in_product_id;

    -- Temporary table to hold related product IDs
    CREATE TEMPORARY TABLE IF NOT EXISTS tmp_related_products (
        product_id INT PRIMARY KEY
    );

    DELETE FROM tmp_related_products;

    -- Fill temporary table with top 10 related product IDs
-- Fill temporary table with top 10 related product IDs
INSERT INTO tmp_related_products (product_id)
SELECT product_id
FROM (
    SELECT product_id, MAX(total_sold) AS total_sold
    FROM (
        -- 1. Sold products first
        SELECT p.product_id, IFNULL(SUM(od.product_quantity), 0) AS total_sold
        FROM products_tb p
        LEFT JOIN order_detail_tb od ON od.product_id = p.product_id
        WHERE p.product_tetcategory = in_tetcategory_id
          AND p.product_id <> in_product_id
        GROUP BY p.product_id

        UNION ALL

        -- 2. Unsold products (force 0 sold)
        SELECT p2.product_id, 0 AS total_sold
        FROM products_tb p2
        WHERE p2.product_tetcategory = in_tetcategory_id
          AND p2.product_id <> in_product_id
          AND p2.product_id NOT IN (
              SELECT DISTINCT product_id
              FROM order_detail_tb
          )
    ) AS merged
    GROUP BY product_id
    ORDER BY total_sold DESC
    LIMIT 10
) AS final_sorted;


    -- Main product details query
    SELECT 
        p.product_id,
        p.product_GTIN,
        p.product_name,
        p.product_desc,
        p.product_link,
        b.brand_name,
        p.product_tetcategory,
        tc.product_tertiary_category_name,
        sc.product_sub_category_name,
        c.category_name,
        IF(in_user_id <> 0 AND EXISTS (
            SELECT 1 FROM product_favorites_tb f
            WHERE f.product_id = p.product_id AND f.user_id = in_user_id
        ), 1, 0) AS favored,
        IFNULL(SUM(od.product_quantity), 0) AS total_sold,
        lp.display_price AS product_price,
        lp.original_price,
        lp.product_discount_price,
        lp.admin_id AS seller_id,
        a2.admin_company_name AS seller_name,
        pt.type_name,
        COUNT(DISTINCT r.review_id) AS review_count,
        ROUND(AVG(r.rating), 1) AS average_rating
    FROM tmp_related_products tmp
    JOIN products_tb p ON p.product_id = tmp.product_id
    JOIN product_brand_tb b ON p.product_brand_id = b.brand_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN product_categorys_tb c ON sc.product_category_id = c.category_id
    LEFT JOIN order_detail_tb od ON od.product_id = p.product_id
    LEFT JOIN (
        SELECT 
            pp1.product_id,
            pp1.product_price AS display_price,
            CASE
                WHEN pp1.product_discount_price IS NOT NULL AND pp1.product_discount_price > pp1.product_price
                    THEN pp1.product_discount_price
                ELSE NULL
            END AS original_price,
            pp1.product_discount_price,
            pp1.admin_id,
            pp1.product_type
        FROM product_prices_tb pp1
        JOIN (
            SELECT product_id, MIN(product_price) AS min_price
            FROM product_prices_tb
            WHERE product_price > 0
            GROUP BY product_id
        ) pp2 ON pp1.product_id = pp2.product_id AND pp1.product_price = pp2.min_price
    ) lp ON lp.product_id = p.product_id
    LEFT JOIN admin_tb a2 ON a2.admin_id = lp.admin_id
    LEFT JOIN product_types_tb pt ON pt.type_id = lp.product_type
    LEFT JOIN order_detail_tb od3 ON od3.product_id = p.product_id
    LEFT JOIN product_review_tb r ON r.order_detail_id = od3.order_detail_id
    WHERE lp.admin_id IS NOT NULL
    GROUP BY p.product_id, lp.admin_id, pt.type_name, lp.display_price, lp.product_discount_price, lp.original_price
    ORDER BY total_sold DESC;

    -- Related product images
    SELECT 
        pi.product_id, 
        pi.image_filename, 
        pi.display_order
    FROM product_images_tb pi
    WHERE pi.product_id IN (SELECT product_id FROM tmp_related_products)
    ORDER BY pi.product_id, pi.display_order;

    -- Cleanup
    DROP TEMPORARY TABLE IF EXISTS tmp_related_products;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
