CREATE DEFINER=`root`@`localhost` PROCEDURE `products_grid_search_similar`(
    IN in_user_id INT,
    IN in_page_number INT,
    IN in_sort_mode VARCHAR(20),          -- 'most_selled' | 'most_rated' | 'lowest_price' | 'highest_price'
    IN in_query VARCHAR(200),             -- free text (can be empty)
    IN in_barcode VARCHAR(100),           -- GTIN / barcode (can be empty)
    IN in_category_id INT,                -- optional
    IN in_sub_category_ids VARCHAR(1000), -- optional CSV
    IN in_tertiary_category_ids VARCHAR(1000), -- optional CSV
    IN in_brand_ids VARCHAR(1000),        -- optional CSV
    IN in_min_price DECIMAL(10,2),        -- optional
    IN in_max_price DECIMAL(10,2)         -- optional
)
BEGIN
  DECLARE offset_value INT DEFAULT 0;

  main: BEGIN
    /* Guard: if both query and barcode are empty, return empty sets like your special proc */
    IF (COALESCE(TRIM(in_query), '') = '' AND COALESCE(TRIM(in_barcode), '') = '') THEN
        SELECT * FROM (SELECT 0 AS product_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS product_id, '' AS image_filename, 0 AS display_order LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS sub_category_id, '' AS sub_category_name, 0 AS category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS tertiary_id, '' AS tertiary_name, 0 AS sub_category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS brand_id, '' AS brand_name LIMIT 0) t;
        SELECT NULL AS actual_min_price, NULL AS actual_max_price;
        LEAVE main;
    END IF;

    SET offset_value = GREATEST((in_page_number - 1) * 10, 0);

    /* 0) Lowest valid price per product (same approach you use) */
    DROP TEMPORARY TABLE IF EXISTS tmp_valid_price;
    CREATE TEMPORARY TABLE tmp_valid_price (
        product_id INT PRIMARY KEY,
        display_price DECIMAL(10,2),
        original_price DECIMAL(10,2),
        product_discount_price DECIMAL(10,2),
        admin_id INT,
        product_type INT
    ) ENGINE=MEMORY;

    INSERT INTO tmp_valid_price
      (product_id, display_price, original_price, product_discount_price, admin_id, product_type)
    WITH ranked AS (
      SELECT
        pp.product_id,
        pp.product_price,
        pp.product_discount_price,
        pp.admin_id,
        pp.product_type,
        ROW_NUMBER() OVER (PARTITION BY pp.product_id ORDER BY pp.product_price ASC, pp.admin_id ASC) AS rn
      FROM product_prices_tb pp
      WHERE pp.product_price > 0 AND pp.admin_id IS NOT NULL
    )
    SELECT
      r.product_id,
      r.product_price AS display_price,
      CASE WHEN r.product_discount_price IS NOT NULL AND r.product_discount_price > r.product_price
           THEN r.product_discount_price ELSE NULL END AS original_price,
      r.product_discount_price,
      r.admin_id,
      r.product_type
    FROM ranked r
    WHERE r.rn = 1;

    /* 1) Build search base with relevance */
    DROP TEMPORARY TABLE IF EXISTS tmp_search_base;
    CREATE TEMPORARY TABLE tmp_search_base (
        product_id INT PRIMARY KEY,
        relevance DOUBLE
    ) ENGINE=MEMORY;

    /* Normalize inputs */
    SET in_query   = NULLIF(TRIM(in_query), '');
    SET in_barcode = NULLIF(TRIM(in_barcode), '');

    /* A) Exact barcode/GTIN hit (very strong) */
    IF in_barcode IS NOT NULL THEN
      INSERT IGNORE INTO tmp_search_base (product_id, relevance)
      SELECT p.product_id, 1000.0
      FROM products_tb p
      WHERE p.product_GTIN = in_barcode OR p.product_link = in_barcode;
    END IF;

    /* B) Partial GTIN starts-with (strong) */
    IF in_barcode IS NOT NULL THEN
      INSERT IGNORE INTO tmp_search_base (product_id, relevance)
      SELECT p.product_id, 500.0
      FROM products_tb p
      WHERE p.product_GTIN LIKE CONCAT(in_barcode, '%');
    END IF;

    /* C) Full-text on name/desc if query given and FT index exists */
    IF in_query IS NOT NULL THEN
      /* NOTE: Create this once (outside): 
         ALTER TABLE products_tb ADD FULLTEXT ft_name_desc (product_name, product_desc);
      */
      INSERT INTO tmp_search_base (product_id, relevance)
      SELECT p.product_id,
             /* FT score plus a small boost if brand matches later */
             MATCH(p.product_name, p.product_desc) AGAINST (in_query IN BOOLEAN MODE) AS rel
      FROM products_tb p
      WHERE MATCH(p.product_name, p.product_desc) AGAINST (in_query IN BOOLEAN MODE) > 0
      ON DUPLICATE KEY UPDATE relevance = GREATEST(relevance, VALUES(relevance));
    END IF;

    /* D) Fallback LIKEs (works even without FT) */
    IF in_query IS NOT NULL THEN
      INSERT INTO tmp_search_base (product_id, relevance)
      SELECT p.product_id,
             /* simple heuristic scoring */
             (CASE WHEN p.product_name LIKE CONCAT('%', in_query, '%') THEN 50 ELSE 0 END) +
             (CASE WHEN p.product_desc LIKE CONCAT('%', in_query, '%') THEN 10 ELSE 0 END) +
             (CASE WHEN b.brand_name  LIKE CONCAT('%', in_query, '%') THEN 30 ELSE 0 END)
      FROM products_tb p
      LEFT JOIN product_brand_tb b ON b.brand_id = p.product_brand_id
      WHERE
        p.product_name LIKE CONCAT('%', in_query, '%')
        OR p.product_desc LIKE CONCAT('%', in_query, '%')
        OR b.brand_name  LIKE CONCAT('%', in_query, '%')
      ON DUPLICATE KEY UPDATE relevance = GREATEST(relevance, VALUES(relevance));
    END IF;

    /* Nothing found? Return empty sets */
    IF (SELECT COUNT(*) FROM tmp_search_base) = 0 THEN
        SELECT * FROM (SELECT 0 AS product_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS product_id, '' AS image_filename, 0 AS display_order LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS sub_category_id, '' AS sub_category_name, 0 AS category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS tertiary_id, '' AS tertiary_name, 0 AS sub_category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS brand_id, '' AS brand_name LIMIT 0) t;
        SELECT NULL AS actual_min_price, NULL AS actual_max_price;
        LEAVE main;
    END IF;

    /* 2) Apply OPTIONAL filters + keep relevance */
    DROP TEMPORARY TABLE IF EXISTS tmp_products;
    CREATE TEMPORARY TABLE tmp_products (
        product_id INT PRIMARY KEY,
        relevance  DOUBLE
    ) ENGINE=MEMORY;

    INSERT IGNORE INTO tmp_products (product_id, relevance)
    SELECT DISTINCT p.product_id, sb.relevance
    FROM tmp_search_base sb
    JOIN products_tb p ON p.product_id = sb.product_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN tmp_valid_price vp ON vp.product_id = p.product_id
    WHERE
        (
          (COALESCE(in_tertiary_category_ids, '') <> '' AND FIND_IN_SET(p.product_tetcategory, in_tertiary_category_ids))
          OR (COALESCE(in_sub_category_ids, '') <> '' AND FIND_IN_SET(tc.product_sub_category_id, in_sub_category_ids))
          OR (COALESCE(in_tertiary_category_ids, '') = '' AND COALESCE(in_sub_category_ids, '') = '' 
              AND in_category_id IS NOT NULL AND in_category_id <> 0 AND sc.product_category_id = in_category_id)
          OR (COALESCE(in_tertiary_category_ids, '') = '' AND COALESCE(in_sub_category_ids, '') = '' 
              AND (in_category_id IS NULL OR in_category_id = 0))
        )
        AND (COALESCE(in_brand_ids, '') = '' OR FIND_IN_SET(p.product_brand_id, in_brand_ids))
        AND (in_min_price IS NULL OR vp.display_price >= in_min_price)
        AND (in_max_price IS NULL OR vp.display_price <= in_max_price);

    /* Empty after filters? Return empty sets */
    IF (SELECT COUNT(*) FROM tmp_products) = 0 THEN
        SELECT * FROM (SELECT 0 AS product_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS product_id, '' AS image_filename, 0 AS display_order LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS sub_category_id, '' AS sub_category_name, 0 AS category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS tertiary_id, '' AS tertiary_name, 0 AS sub_category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS brand_id, '' AS brand_name LIMIT 0) t;
        SELECT NULL AS actual_min_price, NULL AS actual_max_price;
        LEAVE main;
    END IF;

    /* 3) MAIN LIST */
    SELECT 
        p.product_id,
        p.product_GTIN,
        p.product_name,
        p.product_desc,
        p.product_link,
        b.brand_name,
        p.product_tetcategory,
        tc.product_tertiary_category_name,
        sc.product_sub_category_name,
        c.category_name,
        IF(in_user_id <> 0 AND MAX(f.user_id) IS NOT NULL, 1, 0) AS favored,
        IFNULL(SUM(od.product_quantity), 0) AS total_sold,
        vp.display_price AS product_price,
        vp.original_price,
        vp.product_discount_price,
        vp.admin_id AS seller_id,
        a2.admin_company_name AS seller_name,
        pt.type_name,
        COUNT(DISTINCT r.review_id) AS review_count,
        ROUND(AVG(r.rating), 1) AS average_rating,
        tp.relevance
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_brand_tb b ON p.product_brand_id = b.brand_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN product_categorys_tb c ON sc.product_category_id = c.category_id
    LEFT JOIN product_favorites_tb f ON f.product_id = p.product_id AND f.user_id = in_user_id
    LEFT JOIN order_detail_tb od ON od.product_id = p.product_id
    JOIN tmp_valid_price vp ON vp.product_id = p.product_id
    LEFT JOIN admin_tb a2 ON a2.admin_id = vp.admin_id
    LEFT JOIN product_types_tb pt ON pt.type_id = vp.product_type
    LEFT JOIN order_detail_tb od3 ON od3.product_id = p.product_id
    LEFT JOIN product_review_tb r ON r.order_detail_id = od3.order_detail_id
    GROUP BY p.product_id, vp.admin_id, pt.type_name, vp.display_price, vp.product_discount_price, vp.original_price, tp.relevance
    ORDER BY
        /* If a sort mode is chosen, it takes precedence. Otherwise, use relevance */
        CASE WHEN in_sort_mode = 'most_selled'  THEN total_sold END DESC,
        CASE WHEN in_sort_mode = 'most_rated'   THEN average_rating END DESC,
        CASE WHEN in_sort_mode = 'lowest_price' THEN vp.display_price END ASC,
        CASE WHEN in_sort_mode = 'highest_price'THEN vp.display_price END DESC,
        CASE WHEN in_sort_mode IS NULL OR in_sort_mode = '' THEN tp.relevance END DESC,
        p.product_id DESC
    LIMIT 10 OFFSET offset_value;

    /* 4) IMAGES */
    SELECT 
        pi.product_id, 
        pi.image_filename, 
        pi.display_order
    FROM product_images_tb pi
    WHERE pi.product_id IN (SELECT product_id FROM tmp_products)
    ORDER BY pi.product_id, pi.display_order;

    /* 5) SUB-CATEGORIES (FACET) */
    SELECT DISTINCT
        sc.product_sub_category_id AS sub_category_id,
        sc.product_sub_category_name AS sub_category_name,
        sc.product_category_id AS category_id
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN product_categorys_tb c ON sc.product_category_id = c.category_id
    ORDER BY sc.product_sub_category_name;

    /* 6) TERTIARY (FACET) */
    SELECT DISTINCT
        tc.product_tertiary_category_id   AS tertiary_id,
        tc.product_tertiary_category_name AS tertiary_name,
        sc.product_sub_category_id        AS sub_category_id
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    ORDER BY tc.product_tertiary_category_name;

    /* 7) BRANDS (FACET) */
    SELECT DISTINCT
        b.brand_id,
        b.brand_name
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_brand_tb b ON p.product_brand_id = b.brand_id
    ORDER BY b.brand_name;

    /* 8) MIN/MAX PRICE */
    SELECT
        MIN(vp.display_price) AS actual_min_price,
        MAX(vp.display_price) AS actual_max_price
    FROM tmp_products tp
    JOIN tmp_valid_price vp ON vp.product_id = tp.product_id;

  END main;
END ;;
DELIMITER ;
