DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `products_grid_show`(
    IN in_category_id INT,
    IN in_sub_category_ids VARCHAR(1000),
    IN in_tertiary_category_ids VARCHAR(1000),
    IN in_brand_ids VARCHAR(1000),
    IN in_user_id INT,
    IN in_page_number INT,
    IN in_sort_mode VARCHAR(20),
    IN in_min_price DECIMAL(10,2),
    IN in_max_price DECIMAL(10,2)
)
main_block: BEGIN
    DECLARE offset_value INT DEFAULT 0;
    SET offset_value = GREATEST((in_page_number - 1) * 10, 0);

    /* Lowest valid price per product (enforces admin_id present) */
    DROP TEMPORARY TABLE IF EXISTS tmp_valid_price;
    CREATE TEMPORARY TABLE tmp_valid_price (
        product_id INT PRIMARY KEY,
        display_price DECIMAL(10,2),
        original_price DECIMAL(10,2),
        product_discount_price DECIMAL(10,2),
        admin_id INT,
        product_type INT
    ) ENGINE=MEMORY;

    INSERT INTO tmp_valid_price
        (product_id, display_price, original_price, product_discount_price, admin_id, product_type)
    SELECT
        pp1.product_id,
        pp1.product_price,
        CASE
            WHEN pp1.product_discount_price IS NOT NULL AND pp1.product_discount_price > pp1.product_price
                THEN pp1.product_discount_price
            ELSE NULL
        END AS original_price,
        pp1.product_discount_price,
        pp1.admin_id,
        pp1.product_type
    FROM product_prices_tb pp1
    JOIN (
        SELECT product_id, MIN(product_price) AS min_price
        FROM product_prices_tb
        WHERE product_price > 0 AND admin_id IS NOT NULL
        GROUP BY product_id
    ) pp2 ON pp2.product_id = pp1.product_id AND pp2.min_price = pp1.product_price;

    /* Build product set: ONLY normal filters */
    DROP TEMPORARY TABLE IF EXISTS tmp_products;
    CREATE TEMPORARY TABLE tmp_products (
        product_id INT PRIMARY KEY
    ) ENGINE=MEMORY;

    INSERT IGNORE INTO tmp_products (product_id)
    SELECT DISTINCT p.product_id
    FROM products_tb p
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN tmp_valid_price vp ON vp.product_id = p.product_id
    WHERE
        (
          (in_tertiary_category_ids <> '' AND FIND_IN_SET(p.product_tetcategory, in_tertiary_category_ids))
          OR (in_sub_category_ids <> '' AND FIND_IN_SET(tc.product_sub_category_id, in_sub_category_ids))
          OR (in_tertiary_category_ids = '' AND in_sub_category_ids = '' AND in_category_id IS NOT NULL AND in_category_id <> 0 AND sc.product_category_id = in_category_id)
          OR (in_tertiary_category_ids = '' AND in_sub_category_ids = '' AND (in_category_id IS NULL OR in_category_id = 0))
        )
        AND (in_brand_ids = '' OR FIND_IN_SET(p.product_brand_id, in_brand_ids))
        AND (in_min_price IS NULL OR vp.display_price >= in_min_price)
        AND (in_max_price IS NULL OR vp.display_price <= in_max_price);

    /* If empty, short-circuit with empty result sets */
    IF (SELECT COUNT(*) FROM tmp_products) = 0 THEN
        SELECT * FROM (SELECT 0 AS product_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS product_id, '' AS image_filename, 0 AS display_order LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS sub_category_id, '' AS sub_category_name, 0 AS category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS tertiary_id, '' AS tertiary_name, 0 AS sub_category_id LIMIT 0) t;
        SELECT * FROM (SELECT 0 AS brand_id, '' AS brand_name LIMIT 0) t;
        SELECT NULL AS actual_min_price, NULL AS actual_max_price;
        LEAVE main_block;
    END IF;

    /* 1) MAIN LIST */
    SELECT 
        p.product_id,
        p.product_GTIN,
        p.product_name,
        p.product_desc,
        p.product_link,
        b.brand_name,
        p.product_tetcategory,
        tc.product_tertiary_category_name,
        sc.product_sub_category_name,
        c.category_name,
        IF(in_user_id <> 0 AND MAX(f.user_id) IS NOT NULL, 1, 0) AS favored,
        IFNULL(SUM(od.product_quantity), 0) AS total_sold,
        vp.display_price AS product_price,
        vp.original_price,
        vp.product_discount_price,
        vp.admin_id AS seller_id,
        a2.admin_company_name AS seller_name,
        pt.type_name,
        COUNT(DISTINCT r.review_id) AS review_count,
        ROUND(AVG(r.rating), 1) AS average_rating
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_brand_tb b ON p.product_brand_id = b.brand_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN product_categorys_tb c ON sc.product_category_id = c.category_id
    LEFT JOIN product_favorites_tb f ON f.product_id = p.product_id AND f.user_id = in_user_id
    LEFT JOIN order_detail_tb od ON od.product_id = p.product_id
    JOIN tmp_valid_price vp ON vp.product_id = p.product_id
    LEFT JOIN admin_tb a2 ON a2.admin_id = vp.admin_id
    LEFT JOIN product_types_tb pt ON pt.type_id = vp.product_type
    LEFT JOIN order_detail_tb od3 ON od3.product_id = p.product_id
    LEFT JOIN product_review_tb r ON r.order_detail_id = od3.order_detail_id
    GROUP BY p.product_id, vp.admin_id, pt.type_name, vp.display_price, vp.product_discount_price, vp.original_price
    ORDER BY 
        CASE WHEN in_sort_mode = 'most_selled' THEN total_sold END DESC,
        CASE WHEN in_sort_mode = 'most_rated' THEN average_rating END DESC,
        CASE WHEN in_sort_mode = 'lowest_price' THEN vp.display_price END ASC,
        CASE WHEN in_sort_mode = 'highest_price' THEN vp.display_price END DESC,
        p.product_id DESC
    LIMIT 10 OFFSET offset_value;

    /* 2) IMAGES */
    SELECT 
        pi.product_id, 
        pi.image_filename, 
        pi.display_order
    FROM product_images_tb pi
    WHERE pi.product_id IN (SELECT product_id FROM tmp_products)
    ORDER BY pi.product_id, pi.display_order;

    /* 3) SUB-CATEGORIES (FACET) */
    SELECT DISTINCT
        sc.product_sub_category_id AS sub_category_id,
        sc.product_sub_category_name AS sub_category_name,
        sc.product_category_id AS category_id
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    JOIN product_categorys_tb c ON sc.product_category_id = c.category_id
    ORDER BY sc.product_sub_category_name;

    /* 4) TERTIARY (FACET) */
    SELECT DISTINCT
        tc.product_tertiary_category_id   AS tertiary_id,
        tc.product_tertiary_category_name AS tertiary_name,
        sc.product_sub_category_id        AS sub_category_id
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    ORDER BY tc.product_tertiary_category_name;

    /* 5) BRANDS (FACET) */
    SELECT DISTINCT
        b.brand_id,
        b.brand_name
    FROM tmp_products tp
    JOIN products_tb p ON p.product_id = tp.product_id
    JOIN product_brand_tb b ON p.product_brand_id = b.brand_id
    ORDER BY b.brand_name;

    /* 6) MIN/MAX PRICE (FACET RANGE) */
    SELECT
        MIN(vp.display_price) AS actual_min_price,
        MAX(vp.display_price) AS actual_max_price
    FROM tmp_products tp
    JOIN tmp_valid_price vp ON vp.product_id = tp.product_id;

    /* TEMPORARY tables auto-drop at session end */
END main_block ;;
DELIMITER ;
