CREATE DEFINER=`root`@`localhost` PROCEDURE `product_add`(
    IN p_GTIN VARCHAR(85),
    IN p_nameofaproduct VARCHAR(255),
    IN p_nameofaproductdesc TEXT,
    IN p_linkofaproduct VARCHAR(255),
    IN p_user_id INT,
    IN p_category_id INT,
    IN p_subcategory_id INT,
    IN p_tertiary_id INT,
    IN p_brand_id INT
)
BEGIN
    DECLARE valid_relation INT DEFAULT 0;

    -- Check if category → subcategory → tertiary relationship is valid
    SELECT COUNT(*) INTO valid_relation
    FROM product_categorys_tb cat
    JOIN product_sub_category_tb sub ON sub.product_category_id = cat.category_id
    JOIN product_tertiary_category_tb ter ON ter.product_sub_category_id = sub.product_sub_category_id
    WHERE cat.category_id = p_category_id
      AND sub.product_sub_category_id = p_subcategory_id
      AND ter.product_tertiary_category_id = p_tertiary_id
      AND cat.product_categorys_status = 1
      AND sub.product_sub_category_status = 1
      AND ter.product_tertiary_category_status = 1;

    IF valid_relation = 1 THEN
        -- Insert product only if valid
        INSERT INTO products_tb 
        (
            product_GTIN,
            product_name, 
            product_desc, 
            product_link, 
            added_user_id, 
            product_tetcategory,
            product_brand_id,
            product_created_at,
            product_status
        )
        VALUES 
        (
            p_GTIN,
            p_nameofaproduct, 
            p_nameofaproductdesc, 
            p_linkofaproduct, 
            p_user_id, 
            p_tertiary_id,
            p_brand_id,
            NOW(),
            1
        );

        SELECT LAST_INSERT_ID() AS product_id, 'Product inserted successfully' AS message;
    ELSE
        -- Invalid relation: return message
        SELECT NULL AS product_id, 'Invalid category-subcategory-tertiary relationship' AS message;
    END IF;
END ;;
DELIMITER ;
