CREATE DEFINER=`root`@`localhost` PROCEDURE `product_by_id`(
    IN in_product_id INT
)
BEGIN
    -- 1. Get product details along with category tree, brand, and seller (admin)
    SELECT 
        p.product_id,
        p.product_name,
        p.product_price,
        p.product_desc,
        p.product_rating,
        p.product_link,
        p.product_created_at,

        -- Categories
        tc.product_tertiary_category_name,
        sc.product_sub_category_name,
        c.category_name,

        -- Brand
        b.brand_id,
        b.brand_name,

        -- Seller (admin)
        a.admin_id,
        a.admin_company_name,
        a.admin_username,
        a.admin_mail,
        a.admin_phone

    FROM products_tb p
    LEFT JOIN product_tertiary_category_tb tc ON p.product_tetcategory = tc.product_tertiary_category_id
    LEFT JOIN product_sub_category_tb sc ON tc.product_sub_category_id = sc.product_sub_category_id
    LEFT JOIN product_categorys_tb c ON sc.product_category_id = c.category_id
    LEFT JOIN brand_tb b ON p.product_brand_id = b.brand_id
    LEFT JOIN admin_tb a ON p.added_user_id = a.admin_id
    WHERE p.product_id = in_product_id;

    -- 2. Get product images
    SELECT 
        image_id,
        product_id,
        image_filename
    FROM product_images_tb
    WHERE product_id = in_product_id;

    -- 3. Get review summary: count and average rating (can be fractional with halves)
    SELECT 
        COUNT(r.review_id) AS review_count,
        IFNULL(ROUND(AVG(r.rating)*2)/2, 0) AS avg_rating
    FROM review_tb r
    JOIN order_detail_tb od ON r.order_detail_id = od.order_detail_id
    WHERE od.product_id = in_product_id AND r.status = 1; -- Only approved reviews
END ;;
