CREATE DEFINER=`root`@`localhost` PROCEDURE `product_editor_selections_full`(
    IN in_page INT UNSIGNED
)
BEGIN
    DECLARE offset_value INT;
    SET offset_value = (in_page - 1) * 10;

    SELECT 
        p.product_id,
        p.product_name,
        p.product_link,
        IF(es.product_eselection_id IS NOT NULL, 1, 0) AS is_editor_selected,
        es.created_at AS editor_selected_at
    FROM products_tb p
    LEFT JOIN product_editor_selection_tb es
        ON es.product_id = p.product_id AND es.status = 1
    ORDER BY p.product_id DESC
    LIMIT 10 OFFSET offset_value;
END ;;
