CREATE DEFINER=`root`@`localhost` PROCEDURE `product_editor_selection_list`(
)
BEGIN
    DECLARE offset_value INT;
    SET offset_value = 10;

    SELECT 
        p.product_id,
        p.product_name,
        p.product_desc,
        p.product_link,
        (
            SELECT pi.image_filename
            FROM product_images_tb pi
            WHERE pi.product_id = p.product_id
            ORDER BY pi.display_order ASC, pi.image_id ASC
            LIMIT 1
        ) AS image_path
    FROM product_editor_selection_tb es
    JOIN products_tb p ON p.product_id = es.product_id
    WHERE es.status = 1
    ORDER BY es.created_at DESC
    LIMIT offset_value;
END ;;
