CREATE DEFINER=`root`@`localhost` PROCEDURE `product_show`(
    IN in_product_id    INT,
    IN in_admin_id      INT,
    IN p_product_type   INT,
    IN in_user_id INT
)
BEGIN
    DECLARE fallback_type INT;
    DECLARE cnt           INT;

-- 1. Product Details
SELECT 
    p.product_id, p.product_name, p.product_desc, p.product_link, p.product_created_at,p.product_tetcategory,
    tc.product_tertiary_category_name,
    sc.product_sub_category_name,
    c.category_name,c.category_id,
    b.brand_id, b.brand_name,
    a.admin_id, a.admin_company_name, a.admin_username, a.admin_mail, a.admin_phone,
    CASE 
        WHEN pf.favorites_id IS NOT NULL THEN 1
        ELSE 0
    END AS is_favorited
FROM products_tb p
LEFT JOIN product_tertiary_category_tb tc 
  ON p.product_tetcategory = tc.product_tertiary_category_id
LEFT JOIN product_sub_category_tb sc 
  ON tc.product_sub_category_id = sc.product_sub_category_id
LEFT JOIN product_categorys_tb c 
  ON sc.product_category_id = c.category_id
LEFT JOIN product_brand_tb b 
  ON p.product_brand_id = b.brand_id
LEFT JOIN admin_tb a 
  ON p.added_user_id = a.admin_id
LEFT JOIN product_favorites_tb pf 
  ON pf.product_id = p.product_id AND (in_user_id = 0 OR pf.user_id = in_user_id)
WHERE p.product_id = in_product_id;


    
    

    -- 2. Product Images
    SELECT image_id, product_id, image_filename
    FROM product_images_tb
    WHERE product_id = in_product_id;

    -- 3. Review Summary
    SELECT 
        COUNT(r.review_id) AS review_count,
        IFNULL(ROUND(AVG(r.rating) * 2) / 2, 0) AS avg_rating
    FROM product_review_tb r
    JOIN order_detail_tb od 
      ON r.order_detail_id = od.order_detail_id
    WHERE od.product_id = in_product_id
      AND r.status = 1;

    -- Determine which type to show prices for:
    --  a) If a type was passed and prices exist for it → use that
    --  b) Else attempt to find the lowest-price type
    SELECT COUNT(*) INTO cnt
    FROM product_prices_tb
    WHERE product_id     = in_product_id
      AND product_type   = p_product_type
      AND product_price > 0;

    IF cnt > 0 THEN
        SET fallback_type = p_product_type;
    ELSE
        -- Find the type of the absolute lowest price variant
        SELECT pp2.product_type
        INTO fallback_type
        FROM product_prices_tb pp2
        WHERE pp2.product_id     = in_product_id
          AND pp2.product_price > 0
        ORDER BY pp2.product_price ASC
        LIMIT 1;
    END IF;

    -- 4. Product Prices
    IF fallback_type IS NOT NULL THEN
        -- We have a type to filter by (either passed-in or lowest-price)
        SELECT 
            pp.price_id,
            pp.admin_id,
            a.admin_company_name,
            pp.product_price,
            pp.product_discount_price,
            pp.product_quantity,
            pp.product_type,
            pt.type_name,
            pp.created_at,
            CASE WHEN pp.admin_id = in_admin_id THEN 1 ELSE 0 END AS is_my_seller
        FROM product_prices_tb pp
        LEFT JOIN admin_tb a 
          ON pp.admin_id = a.admin_id
        LEFT JOIN product_types_tb pt 
          ON pp.product_type = pt.type_id
        WHERE pp.product_id     = in_product_id
          AND pp.product_price  > 0
          AND pp.product_type   = fallback_type
        ORDER BY 
            is_my_seller DESC,
            pp.product_price ASC;
    ELSE
        -- No fallback type found (no prices at all) → return all prices
        SELECT 
            pp.price_id,
            pp.admin_id,
            a.admin_company_name,
            pp.product_price,
            pp.product_quantity,
            pp.product_type,
            pt.type_name,
            pp.created_at,
            CASE WHEN pp.admin_id = in_admin_id THEN 1 ELSE 0 END AS is_my_seller
        FROM product_prices_tb pp
        LEFT JOIN admin_tb a 
          ON pp.admin_id = a.admin_id
        LEFT JOIN product_types_tb pt 
          ON pp.product_type = pt.type_id
        WHERE pp.product_id    = in_product_id
          AND pp.product_price > 0
        ORDER BY 
            is_my_seller DESC,
            pp.product_price ASC;
    END IF;

    -- 5. All Available Types
    SELECT DISTINCT
        pt.type_id,
        pt.type_name
    FROM product_prices_tb pp
    JOIN product_types_tb pt 
      ON pp.product_type = pt.type_id
    WHERE pp.product_id    = in_product_id
      AND pp.product_price > 0
    ORDER BY pt.type_id ASC;

END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
