CREATE DEFINER=`root`@`localhost` PROCEDURE `product_update`(
IN id int,
IN cproduct_name VARCHAR(45),
IN cproduct_desc VARCHAR(45),
IN cproduct_price DECIMAL(8,2),
IN cproduct_link VARCHAR(60)
)
BEGIN
update products_tb
set product_name=cproduct_name ,product_desc=cproduct_desc,product_price=cproduct_price,product_link=cproduct_link,product_updated_at=NOW()
where product_id=id;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `product_update_admin` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `product_update_admin`(
    IN in_admin_id INT,
    IN in_product_id INT,
    IN in_product_type INT,
    IN in_type VARCHAR(20),        /* 'price' | 'quantity' | 'discount' | 'original' */
    IN in_value DECIMAL(10,2)
)
BEGIN
    DECLARE msg VARCHAR(255) DEFAULT '';
    DECLARE code INT DEFAULT 0;

    DECLARE v_exists INT DEFAULT 0;
    DECLARE v_price DECIMAL(10,2);
    DECLARE v_original DECIMAL(10,2);
    DECLARE v_new_money DECIMAL(10,2);
    DECLARE v_new_qty INT;
    DECLARE v_type VARCHAR(20);

    /* Rollback on unexpected SQL errors */
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        SET msg = 'Internal error while updating.';
        SET code = 500;
        SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
    END;

    /* Normalize input type into a local variable */
    SET v_type = LOWER(TRIM(in_type));

    main: BEGIN
        /* Validate basic inputs */
        IF v_type NOT IN ('price','quantity','discount','original') THEN
            SET msg = 'Invalid update type.';
            SET code = 999;
            SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
            LEAVE main;
        END IF;

        IF v_type IN ('price','discount','original') THEN
            IF in_value IS NULL OR in_value < 0 THEN
                SET msg = 'Amount must be ≥ 0.';
                SET code = 901;
                SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
                LEAVE main;
            END IF;
            SET v_new_money = ROUND(in_value, 2);
        ELSEIF v_type = 'quantity' THEN
            IF in_value IS NULL OR in_value < 0 THEN
                SET msg = 'Quantity must be ≥ 0.';
                SET code = 902;
                SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
                LEAVE main;
            END IF;
            SET v_new_qty = GREATEST(FLOOR(in_value), 0);
        END IF;

        START TRANSACTION;

        /* Ensure row exists & lock it */
        SELECT COUNT(*) INTO v_exists
        FROM product_prices_tb
        WHERE product_id = in_product_id
          AND admin_id = in_admin_id
          AND product_type = in_product_type;

        IF v_exists = 0 THEN
            ROLLBACK;
            SET msg = 'Price row not found for this product/admin/type.';
            SET code = 404;
            SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
            LEAVE main;
        END IF;

        SELECT product_price, product_discount_price
          INTO v_price, v_original
        FROM product_prices_tb
        WHERE product_id = in_product_id
          AND admin_id = in_admin_id
          AND product_type = in_product_type
        FOR UPDATE;

        /* Main logic */

        IF v_type = 'price' THEN
            /* Set new active price */
            UPDATE product_prices_tb
               SET product_price = v_new_money,
                   updated_at = NOW()
             WHERE product_id = in_product_id
               AND admin_id = in_admin_id
               AND product_type = in_product_type;

            /* If active ≥ original, clear original */
            IF v_original IS NOT NULL AND v_new_money >= v_original THEN
                UPDATE product_prices_tb
                   SET product_discount_price = NULL,
                       updated_at = NOW()
                 WHERE product_id = in_product_id
                   AND admin_id = in_admin_id
                   AND product_type = in_product_type;
                SET msg = 'Price updated. Original removed because it was ≤ new price.';
                SET code = 2;
            ELSE
                SET msg = 'Price updated successfully.';
                SET code = 1;
            END IF;

        ELSEIF v_type = 'quantity' THEN
            UPDATE product_prices_tb
               SET product_quantity = v_new_qty,
                   updated_at = NOW()
             WHERE product_id = in_product_id
               AND admin_id = in_admin_id
               AND product_type = in_product_type;

            SET msg = 'Quantity updated successfully.';
            SET code = 3;

        ELSEIF v_type = 'discount' THEN
            /* Apply a discount: new active must be strictly lower than current active */
            IF v_new_money >= v_price THEN
                ROLLBACK;
                SET msg = 'Discounted price must be strictly lower than the current price.';
                SET code = 100;
                SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
                LEAVE main;
            END IF;

            UPDATE product_prices_tb
               SET product_discount_price = v_price,   /* save old active as original */
                   product_price = v_new_money,        /* new lower active */
                   updated_at = NOW()
             WHERE product_id = in_product_id
               AND admin_id = in_admin_id
               AND product_type = in_product_type;

            SET msg = CONCAT('Discount applied. Active ₺', FORMAT(v_new_money, 2),
                             ' | Original ₺', FORMAT(v_price, 2), ' saved.');
            SET code = 4;

        ELSEIF v_type = 'original' THEN
            /* Set or clear the original (crossed-out) price */
            IF v_new_money IS NULL OR v_new_money = 0 THEN
                /* Clear original explicitly */
                UPDATE product_prices_tb
                   SET product_discount_price = NULL,
                       updated_at = NOW()
                 WHERE product_id = in_product_id
                   AND admin_id = in_admin_id
                   AND product_type = in_product_type;

                SET msg = 'Original price cleared (no discount).';
                SET code = 5;

            ELSE
                /* Original must be strictly greater than active */
                IF v_new_money <= v_price THEN
                    ROLLBACK;
                    SET msg = CONCAT('Original (', FORMAT(v_new_money,2),
                                     ') must be greater than active (', FORMAT(v_price,2), ').');
                    SET code = 101;
                    SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
                    LEAVE main;
                END IF;

                UPDATE product_prices_tb
                   SET product_discount_price = v_new_money,
                       updated_at = NOW()
                 WHERE product_id = in_product_id
                   AND admin_id = in_admin_id
                   AND product_type = in_product_type;

                SET msg = CONCAT('Original set to ₺', FORMAT(v_new_money,2),
                                 ' (active ₺', FORMAT(v_price,2), ').');
                SET code = 5;
            END IF;
        END IF;

        /* Final safety: auto-fix inversions */
        UPDATE product_prices_tb
           SET product_discount_price = NULL,
               updated_at = NOW()
         WHERE product_id = in_product_id
           AND admin_id = in_admin_id
           AND product_type = in_product_type
           AND product_discount_price IS NOT NULL
           AND product_price >= product_discount_price;

        COMMIT;

        SELECT msg AS response, in_product_id AS product_id, in_product_type AS product_type, code;
    END main;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
