CREATE DEFINER=`root`@`localhost` PROCEDURE `reviews_get_pending`(IN p_user_id INT)
BEGIN
    SELECT 
        od.order_detail_id,
        o.created_at AS order_date,
        p.product_id,
        CONCAT(b.brand_name, ' ', p.product_name) AS product_full_name,
        p.product_link,
        pi.image_filename
    FROM order_detail_tb od
    JOIN order_tb o ON o.order_id = od.order_id
    JOIN products_tb p ON p.product_id = od.product_id
    JOIN product_brand_tb b ON b.brand_id = p.product_brand_id
    LEFT JOIN product_images_tb pi ON pi.product_id = p.product_id AND pi.display_order = 1
    LEFT JOIN product_review_tb r ON r.order_detail_id = od.order_detail_id
    WHERE o.user_id = p_user_id
      AND r.review_id IS NULL; -- not reviewed yet
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `reviews_get_user` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
