/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `reviews_get_user`(IN p_user_id INT)
BEGIN
    SELECT 
        r.review_id,
        r.rating,
        r.comment,
        r.created_at,
        CONCAT(b.brand_name, ' ', p.product_name) AS product_full_name
    FROM product_review_tb r
    INNER JOIN order_detail_tb od ON r.order_detail_id = od.order_detail_id
    INNER JOIN order_tb o ON od.order_id = o.order_id
    INNER JOIN products_tb p ON od.product_id = p.product_id
    INNER JOIN product_brand_tb b ON b.brand_id = p.product_brand_id
    WHERE o.user_id = p_user_id
    ORDER BY r.created_at DESC;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `review_add` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `review_add`(
    IN p_user_id INT,
    IN p_order_detail_id INT,
    IN p_rating INT,
    IN p_comment TEXT
)
BEGIN
    DECLARE v_order_id INT;
    DECLARE v_order_user_id INT;
    DECLARE review_exists INT DEFAULT 0;

    -- Get the order_id from order_detail
    SELECT order_id INTO v_order_id
    FROM order_detail_tb
    WHERE order_detail_id = p_order_detail_id;

    -- Get user_id from the order
    SELECT user_id INTO v_order_user_id
    FROM order_tb
    WHERE order_id = v_order_id;

    -- Check if the review already exists
    SELECT COUNT(*) INTO review_exists
    FROM product_review_tb
    WHERE order_detail_id = p_order_detail_id;

    -- Only allow insert if user owns the order and no review yet
    IF v_order_user_id = p_user_id AND review_exists = 0 THEN
        INSERT INTO product_review_tb (
            order_detail_id,
            rating,
            comment,
            created_at,
            status
        ) VALUES (
            p_order_detail_id,
            p_rating,
            p_comment,
            NOW(),
            1
        );
    END IF;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `search_autocomplete` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8mb4 */ ;
/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `search_autocomplete`(
    IN p_search_term VARCHAR(255)
)
BEGIN
    DECLARE v_word VARCHAR(255);
    DECLARE v_terms TEXT;
    DECLARE v_pos INT;

    /* 5 tabloyu hazırla */
    DROP TEMPORARY TABLE IF EXISTS temp_cat;
    DROP TEMPORARY TABLE IF EXISTS temp_sub;
    DROP TEMPORARY TABLE IF EXISTS temp_tet;
    DROP TEMPORARY TABLE IF EXISTS temp_prod;
    DROP TEMPORARY TABLE IF EXISTS temp_output;

    CREATE TEMPORARY TABLE temp_cat  (
        value_id INT, label VARCHAR(255), type VARCHAR(50), GTIN VARCHAR(50), fulltexts TEXT
    );
    CREATE TEMPORARY TABLE temp_sub  LIKE temp_cat;
    CREATE TEMPORARY TABLE temp_tet  LIKE temp_cat;
    CREATE TEMPORARY TABLE temp_prod LIKE temp_cat;
    CREATE TEMPORARY TABLE temp_output LIKE temp_cat;

    /* Category */
    INSERT INTO temp_cat
    SELECT c.category_id,
           CONCAT('> ', c.category_name),
           'category',
           NULL,
           c.category_name
    FROM product_categorys_tb c
    WHERE c.product_categorys_status = 1;

    /* Sub-Category */
    INSERT INTO temp_sub
    SELECT s.product_sub_category_id,
           CONCAT('> ', c.category_name, ' > ', s.product_sub_category_name),
           'sub-category',
           NULL,
           CONCAT_WS(' ', c.category_name, s.product_sub_category_name)
    FROM product_sub_category_tb s
    JOIN product_categorys_tb c ON c.category_id = s.product_category_id
    WHERE s.product_sub_category_status = 1
      AND c.product_categorys_status = 1;

    /* Tertiary */
    INSERT INTO temp_tet
    SELECT t.product_tertiary_category_id,
           CONCAT('> ', c.category_name, ' > ', s.product_sub_category_name, ' > ', t.product_tertiary_category_name),
           'tet-category',
           NULL,
           CONCAT_WS(' ', c.category_name, s.product_sub_category_name, t.product_tertiary_category_name)
    FROM product_tertiary_category_tb t
    JOIN product_sub_category_tb s ON s.product_sub_category_id = t.product_sub_category_id
    JOIN product_categorys_tb c ON c.category_id = s.product_category_id
    WHERE t.product_tertiary_category_status = 1
      AND s.product_sub_category_status = 1
      AND c.product_categorys_status = 1;

    /* Product */
    INSERT INTO temp_prod
    SELECT p.product_id,
           CONCAT(b.brand_name, ' ', p.product_name),
           'product',
           p.product_GTIN,
           CONCAT_WS(' ', b.brand_name, p.product_name, p.product_GTIN)
    FROM products_tb p
    JOIN product_brand_tb b ON b.brand_id = p.product_brand_id
    JOIN product_tertiary_category_tb t ON t.product_tertiary_category_id = p.product_tetcategory
    JOIN product_sub_category_tb s ON s.product_sub_category_id = t.product_sub_category_id
    JOIN product_categorys_tb c ON c.category_id = s.product_category_id
    WHERE p.product_status = 1
      AND b.brand_status = 1
      AND t.product_tertiary_category_status = 1
      AND s.product_sub_category_status = 1
      AND c.product_categorys_status = 1;

    /* Kelime kelime daralt */
    SET v_terms = TRIM(p_search_term);
    WHILE LENGTH(v_terms) > 0 DO
        SET v_pos = LOCATE(' ', v_terms);
        IF v_pos > 0 THEN
            SET v_word = SUBSTRING(v_terms, 1, v_pos - 1);
            SET v_terms = SUBSTRING(v_terms, v_pos + 1);
        ELSE
            SET v_word = v_terms;
            SET v_terms = '';
        END IF;

        DELETE FROM temp_cat  WHERE fulltexts NOT LIKE CONCAT('%', v_word, '%');
        DELETE FROM temp_sub  WHERE fulltexts NOT LIKE CONCAT('%', v_word, '%');
        DELETE FROM temp_tet  WHERE fulltexts NOT LIKE CONCAT('%', v_word, '%');
        DELETE FROM temp_prod WHERE fulltexts NOT LIKE CONCAT('%', v_word, '%');
    END WHILE;

    /* Final tabloya LIMIT'li aktarım (iki ayrı INSERT, tek tabloya okuma yapılacak) */
    INSERT INTO temp_output
    SELECT value_id, label, type, GTIN, fulltexts FROM (
        SELECT value_id, label, type, GTIN, fulltexts FROM temp_cat
        UNION ALL
        SELECT value_id, label, type, GTIN, fulltexts FROM temp_sub
        UNION ALL
        SELECT value_id, label, type, GTIN, fulltexts FROM temp_tet
    ) AS cats
    LIMIT 3;

    INSERT INTO temp_output
    SELECT value_id, label, type, GTIN, fulltexts
    FROM temp_prod
    LIMIT 7;

    /* Tek SELECT: 1137 yok */
    SELECT value_id, label, type, GTIN
    FROM temp_output;

    /* Temizlik */
    DROP TEMPORARY TABLE temp_cat;
    DROP TEMPORARY TABLE temp_sub;
    DROP TEMPORARY TABLE temp_tet;
    DROP TEMPORARY TABLE temp_prod;
    DROP TEMPORARY TABLE temp_output;
END ;;
DELIMITER ;
