/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `search_products`(
    IN p_search_term VARCHAR(255)
)
BEGIN
    DECLARE v_word VARCHAR(255);
    DECLARE v_terms TEXT;
    DECLARE v_pos INT;

    -- Temporary table to hold limited product ids
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_product_ids (product_id INT PRIMARY KEY);

    TRUNCATE TABLE temp_product_ids;

    -- Build a base query result set
    CREATE TEMPORARY TABLE IF NOT EXISTS temp_filtered AS
    SELECT p.product_id,
           CONCAT_WS(' ', p.product_name, b.brand_name, p.product_GTIN) AS fulltexts
    FROM products_tb p
    JOIN product_brand_tb b ON p.product_brand_id = b.brand_id;

    -- loop through each word in p_search_term
    SET v_terms = TRIM(p_search_term);

    WHILE LENGTH(v_terms) > 0 DO
        -- get first word
        SET v_pos = LOCATE(' ', v_terms);
        IF v_pos > 0 THEN
            SET v_word = SUBSTRING(v_terms, 1, v_pos - 1);
            SET v_terms = SUBSTRING(v_terms, v_pos + 1);
        ELSE
            SET v_word = v_terms;
            SET v_terms = '';
        END IF;

        -- progressively filter
        DELETE FROM temp_filtered
        WHERE fulltexts NOT LIKE CONCAT('%', v_word, '%');
    END WHILE;

    -- Insert top 10 product IDs from filtered results
    INSERT INTO temp_product_ids (product_id)
    SELECT product_id
    FROM temp_filtered
    LIMIT 10;

    DROP TEMPORARY TABLE temp_filtered;

    -- First select: get product info with images, joining temp table
    SELECT 
        p.product_id,
        p.product_GTIN,
        p.product_name,
        p.product_link,
        b.brand_id,
        b.brand_name AS product_brand,
        p.product_tetcategory,
        pi.image_filename
    FROM products_tb p
    JOIN temp_product_ids tpi ON p.product_id = tpi.product_id
    LEFT JOIN product_images_tb pi 
           ON p.product_id = pi.product_id AND pi.display_order = 1
    LEFT JOIN product_brand_tb b 
           ON p.product_brand_id = b.brand_id;

    -- Second select: get types based on the category of those products
    SELECT 
        pt.type_id,
        pt.category_id,
        pt.type_name,
        tpi.product_id
    FROM products_tb p
    JOIN product_tertiary_category_tb ptet 
           ON p.product_tetcategory = ptet.product_tertiary_category_id
    JOIN product_sub_category_tb psub 
           ON ptet.product_sub_category_id = psub.product_sub_category_id
    JOIN product_categorys_tb pc 
           ON psub.product_category_id = pc.category_id
    JOIN product_types_tb pt 
           ON pt.category_id = pc.category_id
    JOIN temp_product_ids tpi ON p.product_id = tpi.product_id;
END ;;
DELIMITER ;
