CREATE DEFINER=`root`@`localhost` PROCEDURE `seller_order_counts`(
    IN p_seller_id INT
)
BEGIN
	SELECT 
        a.admin_id AS seller_id,
        a.admin_company_name AS seller_name,
        IFNULL(SUM(CASE WHEN s.shipping_status = 'waiting' THEN 1 ELSE 0 END), 0) AS waiting_count,
        IFNULL(SUM(CASE WHEN s.shipping_status = 'shipped' THEN 1 ELSE 0 END), 0) AS shipped_count,
        IFNULL(SUM(CASE WHEN s.shipping_status = 'completed' THEN 1 ELSE 0 END), 0) AS completed_count
    FROM admin_tb a
    LEFT JOIN order_detail_tb od ON od.seller_id = a.admin_id
    LEFT JOIN shipment_tb s ON s.shipment_id = od.shipment_id
    WHERE a.admin_id = p_seller_id
    GROUP BY a.admin_id, a.admin_company_name;
END ;;
