CREATE DEFINER=`root`@`localhost` PROCEDURE `seller_shipments_by_status`(
    IN p_seller_id INT,
    IN p_status ENUM('waiting', 'shipped', 'completed'),
    IN p_page INT,
    IN p_page_size INT
)
BEGIN
    DECLARE v_offset INT;
    SET v_offset = (p_page - 1) * p_page_size;

    -- Result Set 1: Shipment + Product Details (paginated)
    SELECT 
        s.shipment_id,
        od.seller_id,
        s.order_id,
        s.shipping_status,
        s.created_at AS shipment_created_at,
        s.tracking_number,
        s.shipping_company,
        s.eta,

        (od.product_price * od.product_quantity) AS product_total_paid,
        o.order_status,
        o.created_at AS order_created_at,

        -- Product details
        p.product_id,
        p.product_name,
        p.product_desc,
        p.product_link,
        p.product_GTIN,

        -- Brand info
        b.brand_id,
        b.brand_name,

        -- Product type info
        pt.type_id,
        pt.type_name,

        -- Order detail
        od.product_quantity,

        -- First image
        pi.image_filename

    FROM shipment_tb s
    JOIN order_tb o ON o.order_id = s.order_id
    JOIN order_detail_tb od ON od.shipment_id = s.shipment_id
    JOIN products_tb p ON p.product_id = od.product_id
    JOIN product_brand_tb b ON b.brand_id = p.product_brand_id
    LEFT JOIN product_types_tb pt ON pt.type_id = od.type_id
    LEFT JOIN product_images_tb pi 
        ON pi.product_id = p.product_id AND pi.display_order = 1

    WHERE od.seller_id = p_seller_id
      AND s.shipping_status = p_status

    ORDER BY s.created_at DESC
    LIMIT v_offset, p_page_size;

    -- Result Set 2: Total count of distinct shipments
    SELECT COUNT(DISTINCT s.shipment_id) AS total_shipments
    FROM shipment_tb s
    JOIN order_detail_tb od ON od.shipment_id = s.shipment_id
    WHERE od.seller_id = p_seller_id
      AND s.shipping_status = p_status;
END ;;
DELIMITER ;
