CREATE DEFINER=`root`@`localhost` PROCEDURE `shoppingcart_add`(
    IN p_user_id INT,
    IN p_product_id INT,
    IN p_quantity INT,
    IN p_seller_id INT,
    IN p_type_id INT
)
BEGIN
    DECLARE existing_item INT DEFAULT 0;
    DECLARE available_quantity INT DEFAULT NULL;
    DECLARE seller_item_count INT DEFAULT 0;
    DECLARE shipping_for_insert DECIMAL(10,2) DEFAULT 0.00;

    /* 1) Validate: seller carries this product+type with enough stock */
    SELECT product_quantity INTO available_quantity
    FROM product_prices_tb
    WHERE product_id = p_product_id
      AND admin_id   = p_seller_id
      AND product_type = p_type_id
      AND product_quantity >= p_quantity
    LIMIT 1;

    IF available_quantity IS NULL THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'This product is not available from this seller with this type or not enough quantity.';
    END IF;

    /* 2) Does this exact cart line already exist? */
    SELECT COUNT(*) INTO existing_item
    FROM shoppingcart_tb
    WHERE user_id    = p_user_id
      AND product_id = p_product_id
      AND seller_id  = p_seller_id
      AND type_id    = p_type_id
      AND cart_status = 1;

    /* 3) How many active items from this seller are already in the cart? */
    SELECT COUNT(*) INTO seller_item_count
    FROM shoppingcart_tb
    WHERE user_id    = p_user_id
      AND seller_id  = p_seller_id
      AND cart_status = 1;

    /* First item per seller => charge 50; else 0 */
    IF seller_item_count = 0 THEN
        SET shipping_for_insert = 50.00;
    ELSE
        SET shipping_for_insert = 0.00;
    END IF;

    /* 4) Insert or update */
    IF existing_item = 0 THEN
        INSERT INTO shoppingcart_tb (
            user_id, product_id, quantity, created_at, cart_status, seller_id, type_id, shipment_cost
        ) VALUES (
            p_user_id, p_product_id, p_quantity, NOW(), 1, p_seller_id, p_type_id, shipping_for_insert
        );
    ELSE
        /* keep shipment_cost as-is on the existing line */
        UPDATE shoppingcart_tb
        SET quantity = quantity + p_quantity
        WHERE user_id    = p_user_id
          AND product_id = p_product_id
          AND seller_id  = p_seller_id
          AND type_id    = p_type_id
          AND cart_status = 1;
    END IF;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
