DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `shoppingcart_items`(
    IN p_user_id INT
)
BEGIN
    SELECT 
        sc.cart_id,
        sc.product_id,
        p.product_name,
        p.product_desc,
        pp.product_price,
        p.product_link,
        sc.quantity,
        (pp.product_price * sc.quantity) AS total_price,

        -- Image
        pi.image_filename,

        -- Brand Info
        b.brand_id,
        b.brand_name,

        -- Category Info
        pc.category_id,
        pc.category_name,

        -- Sub-Category Info
        psc.product_sub_category_id,
        psc.product_sub_category_name,

        -- Tertiary Category Info
        ptc.product_tertiary_category_id,
        ptc.product_tertiary_category_name,

        -- Admin Info
        a.admin_id,
        a.admin_company_name,
        a.admin_username,
        a.admin_mail,
        a.admin_phone,

        -- ✅ Type Info
        sc.type_id,
        CASE 
            WHEN sc.type_id = 0 THEN ''
            ELSE pt.type_name
        END AS type_name

    FROM shoppingcart_tb sc

    -- Main product table
    JOIN products_tb p ON sc.product_id = p.product_id

    -- ✔ JOIN seller-specific product price
    JOIN product_prices_tb pp 
        ON pp.product_id = sc.product_id 
       AND pp.admin_id = sc.seller_id 
       AND pp.product_type = sc.type_id

    -- ✅ Join the type table to get the type name
    LEFT JOIN product_types_tb pt 
        ON pt.type_id = sc.type_id

    -- Image
    LEFT JOIN product_images_tb pi 
        ON pi.product_id = p.product_id AND pi.display_order = 1

    -- Tertiary Category
    LEFT JOIN product_tertiary_category_tb ptc 
        ON p.product_tetcategory = ptc.product_tertiary_category_id

    -- Sub-Category
    LEFT JOIN product_sub_category_tb psc 
        ON ptc.product_sub_category_id = psc.product_sub_category_id

    -- Category
    LEFT JOIN product_categorys_tb pc 
        ON psc.product_category_id = pc.category_id

    -- Brand
    LEFT JOIN product_brand_tb b 
        ON p.product_brand_id = b.brand_id

    -- Admin
    LEFT JOIN admin_tb a 
        ON p.added_user_id = a.admin_id

    WHERE sc.user_id = p_user_id AND sc.cart_status = 1;
END ;;
DELIMITER ;
