CREATE DEFINER=`root`@`localhost` PROCEDURE `shoppingcart_item_delete`(
    IN p_user_id INT,
    IN p_product_id INT,
    IN p_type_id INT
)
BEGIN
    DECLARE v_coupon_id INT;
    DECLARE v_coupon_removed BOOL DEFAULT FALSE;

    -- 1. Delete the specific item
    DELETE FROM shoppingcart_tb
    WHERE user_id = p_user_id
      AND product_id = p_product_id
      AND type_id = p_type_id
      AND cart_status = 1;

    -- 2. Get currently active coupon
    SELECT coupon_id INTO v_coupon_id
    FROM coupon_active_tb
    WHERE user_id = p_user_id
    LIMIT 1;

    -- 3. Check if coupon still applies
    IF v_coupon_id IS NOT NULL THEN
        IF NOT EXISTS (
            -- product match
            SELECT 1 FROM shoppingcart_tb sc
            JOIN coupon_product_tb cp ON cp.product_id = sc.product_id
            WHERE sc.user_id = p_user_id AND sc.cart_status = 1 AND cp.coupon_id = v_coupon_id

            UNION

            -- tertiary category match
            SELECT 1 FROM shoppingcart_tb sc
            JOIN products_tb p ON p.product_id = sc.product_id
            JOIN product_tertiary_category_tb tc ON tc.product_tertiary_category_id = p.product_tetcategory
            JOIN coupon_category_tb cc ON cc.tertiary_category_id = tc.product_tertiary_category_id
            WHERE sc.user_id = p_user_id AND sc.cart_status = 1 AND cc.coupon_id = v_coupon_id
        ) THEN
            DELETE FROM coupon_active_tb
            WHERE user_id = p_user_id AND coupon_id = v_coupon_id;

            SET v_coupon_removed = TRUE;
        END IF;
    END IF;

    -- 4. Return result
    SELECT TRUE AS success, v_coupon_removed AS coupon_removed;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
