CREATE DEFINER=`root`@`localhost` PROCEDURE `shoppingcart_q_update`(
    IN p_cart_id INT, 
    IN p_quantity INT,
    OUT new_quantity INT,
    OUT total_price DECIMAL(10,2)
)
BEGIN
    DECLARE _product_id INT DEFAULT 0;
    DECLARE _seller_id INT DEFAULT 0;
    DECLARE _type_id INT DEFAULT 0;
    DECLARE _price DECIMAL(10,2) DEFAULT 0;

    -- 1. Update quantity
    UPDATE shoppingcart_tb
    SET quantity = p_quantity
    WHERE cart_id = p_cart_id AND cart_status = 1;

    -- 2. Get product_id, seller_id, type_id from cart
    SELECT product_id, seller_id, type_id
    INTO _product_id, _seller_id, _type_id
    FROM shoppingcart_tb
    WHERE cart_id = p_cart_id
    LIMIT 1;

    -- 3. Get exact price from product_prices_tb
    IF _product_id IS NOT NULL THEN
        SELECT product_price INTO _price
        FROM product_prices_tb
        WHERE product_id = _product_id
          AND admin_id = _seller_id
          AND product_type = _type_id
        LIMIT 1;
    END IF;

    -- 4. Set output values
    SET new_quantity = p_quantity;
    SET total_price = IFNULL(_price, 0) * new_quantity;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
