/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `shoppingcart_total`(
    IN p_user_id INT,
    OUT total_amount DECIMAL(10,2)
)
BEGIN
    DECLARE v_subtotal DECIMAL(10,2) DEFAULT 0;
    DECLARE v_coupon_discount DECIMAL(10,2) DEFAULT 0;
    DECLARE v_shipping DECIMAL(10,2) DEFAULT 0;

    -- 1) Subtotal (tüm ürünler)
    SELECT SUM(pp.product_price * sc.quantity) INTO v_subtotal
    FROM shoppingcart_tb sc
    JOIN product_prices_tb pp 
        ON pp.product_id = sc.product_id 
        AND pp.product_type = sc.type_id
        AND pp.admin_id = sc.seller_id
    WHERE sc.user_id = p_user_id 
      AND sc.cart_status = 1;

    IF v_subtotal IS NULL THEN 
        SET v_subtotal = 0; 
    END IF;

    -- 2) Shipping total (her satıcı için max shipment_cost)
    SELECT SUM(max_cost) INTO v_shipping
    FROM (
        SELECT MAX(sc.shipment_cost) AS max_cost
        FROM shoppingcart_tb sc
        WHERE sc.user_id = p_user_id 
          AND sc.cart_status = 1
        GROUP BY sc.seller_id
    ) t;

    IF v_shipping IS NULL THEN 
        SET v_shipping = 0; 
    END IF;

    -- 3) Active coupon discount
    SELECT c.discount_amount INTO v_coupon_discount
    FROM coupon_active_tb a
    JOIN coupons_tb c ON c.coupon_id = a.coupon_id
    WHERE a.user_id = p_user_id
    LIMIT 1;

    IF v_coupon_discount IS NULL THEN 
        SET v_coupon_discount = 0; 
    END IF;

    -- 4) Final total
    SET total_amount = GREATEST(0, v_subtotal + v_shipping - v_coupon_discount);
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `shoppingcart_user_shipping_total` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
