/*!50003 SET character_set_results = utf8mb4 */ ;
/*!50003 SET collation_connection  = utf8mb4_0900_ai_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'ONLY_FULL_GROUP_BY,STRICT_TRANS_TABLES,NO_ZERO_IN_DATE,NO_ZERO_DATE,ERROR_FOR_DIVISION_BY_ZERO,NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `shoppingcart_user_shipping_total`(
    IN p_user_id INT
)
BEGIN
    DECLARE subtotal DECIMAL(12,2) DEFAULT 0.00;
    DECLARE shipping_total DECIMAL(12,2) DEFAULT 0.00;
    DECLARE coupon_discount DECIMAL(12,2) DEFAULT 0.00;
    DECLARE grand_total DECIMAL(12,2) DEFAULT 0.00;

    -- 1. Subtotal = sum of product price × quantity in the cart
    SELECT COALESCE(SUM(pp.product_price * sc.quantity), 0.00)
    INTO subtotal
    FROM shoppingcart_tb sc
    JOIN product_prices_tb pp 
         ON pp.product_id   = sc.product_id
        AND pp.admin_id     = sc.seller_id
        AND pp.product_type = sc.type_id
    WHERE sc.user_id = p_user_id
      AND sc.cart_status = 1;

    -- 2. Shipping = her satıcı için MAX(shipment_cost)
    SELECT COALESCE(SUM(max_cost), 0.00)
    INTO shipping_total
    FROM (
        SELECT MAX(sc.shipment_cost) AS max_cost
        FROM shoppingcart_tb sc
        WHERE sc.user_id = p_user_id
          AND sc.cart_status = 1
        GROUP BY sc.seller_id
    ) t;

    -- 3. Coupon discount (if any active)
    SELECT COALESCE(MAX(c.discount_amount), 0.00)
    INTO coupon_discount
    FROM coupon_active_tb ca
    JOIN coupons_tb c ON c.coupon_id = ca.coupon_id
    WHERE ca.user_id = p_user_id;

    -- 4. Grand total
    SET grand_total = GREATEST(subtotal + shipping_total - coupon_discount, 0.00);

    -- 5. Return one row with all values
    SELECT 
        subtotal,
        shipping_total,
        coupon_discount,
        grand_total;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
