CREATE DEFINER=`root`@`localhost` PROCEDURE `simulate_shipment_status`(
    IN in_shipment_id INT
)
BEGIN
    DECLARE current_status VARCHAR(20);

    -- Get current shipping status
    SELECT shipping_status INTO current_status
    FROM shipment_tb
    WHERE shipment_id = in_shipment_id;

    -- Transition from 'waiting' → 'shipped'
    IF current_status = 'waiting' THEN
        UPDATE shipment_tb
        SET 
            shipping_status = 'shipped',
            shipped_at = NOW()
        WHERE shipment_id = in_shipment_id;

    -- Transition from 'shipped' → 'completed'
    ELSEIF current_status = 'shipped' THEN
        UPDATE shipment_tb
        SET 
            shipping_status = 'completed',
            delivered_at = NOW()
        WHERE shipment_id = in_shipment_id;
    END IF;
END ;;
DELIMITER ;
