CREATE DEFINER=`root`@`localhost` PROCEDURE `user_addresses_show`(
IN p_user_id INT

)
BEGIN
    SELECT 
        ua.user_address_id,
        ua.user_firstname,
        ua.user_lastname,
        ua.neighborhood_id,
        n.neighborhood_name, -- Getting neighborhood name
        d.district_id,
        d.district_name, -- Getting district name
        p.province_id,
