CREATE DEFINER=`root`@`localhost` PROCEDURE `user_address_show`(
  IN p_user_id INT,
  IN p_address_id INT
)
BEGIN
  DECLARE v_exists INT;

  -- 1) Verify that this address belongs to the given user
  SELECT COUNT(*)
    INTO v_exists
    FROM user_address
   WHERE user_id = p_user_id
     AND user_address_id = p_address_id;

  IF v_exists = 0 THEN
    SIGNAL SQLSTATE '45000'
      SET MESSAGE_TEXT = 'Address not found for this user';
  END IF;

  -- 2) If it exists, return the full detail
  SELECT 
      ua.user_address_id,
      ua.user_firstname,
      ua.user_lastname,
      ua.neighborhood_id,
      n.neighborhood_name,
      d.district_id,
      d.district_name,
      p.province_id,
      p.province_name,
      ua.user_address_note,
      ua.user_address_phone,
      ua.user_address_type,
      ua.user_address_taxornationalid,
      ua.user_address_tax_office,
      ua.user_address_company_name,
      ua.user_address_einvoice_taxpayer,
      ua.user_address_created_at
    FROM user_address AS ua
    JOIN address_neighborhood_tb AS n ON ua.neighborhood_id = n.neighborhood_id
    JOIN address_district_tb    AS d ON n.district_id       = d.district_id
    JOIN address_province_tb    AS p ON d.province_id       = p.province_id
   WHERE ua.user_id         = p_user_id
     AND ua.user_address_id = p_address_id;
END ;;
