CREATE DEFINER=`root`@`localhost` PROCEDURE `user_address_update`(
    IN p_user_id INT,
    IN p_user_address_id INT,
    IN p_first_name VARCHAR(50),
    IN p_last_name VARCHAR(50),
    IN p_neighborhood_id INT,
    IN p_district_id INT,
    IN p_province_id INT,
    IN p_phone_number VARCHAR(20),
    IN p_address_note VARCHAR(255),
    IN p_tax_or_national_id VARCHAR(50),
    IN p_tax_office VARCHAR(100),
    IN p_company_name VARCHAR(100),
    IN p_is_einvoice BOOLEAN
)
BEGIN
    DECLARE v_exists INT;
    DECLARE v_address_type TINYINT(1);
    DECLARE cleaned_phone_number VARCHAR(20);
    DECLARE v_user_match INT;

    -- Check valid neighborhood/district/province combination
    SELECT COUNT(*)
    INTO v_exists
    FROM address_neighborhood_tb
    JOIN address_district_tb ON address_neighborhood_tb.district_id = address_district_tb.district_id
    JOIN address_province_tb ON address_district_tb.province_id = address_province_tb.province_id
    WHERE address_neighborhood_tb.neighborhood_id = p_neighborhood_id
      AND address_district_tb.district_id = p_district_id
      AND address_province_tb.province_id = p_province_id;

    IF v_exists = 0 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Invalid neighborhood, district, or province combination!';
    ELSE
        -- Optional: Check the address belongs to the user
        SELECT COUNT(*) INTO v_user_match
        FROM user_address
        WHERE user_address_id = p_user_address_id AND user_id = p_user_id;

        IF v_user_match = 0 THEN
            SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'This address does not belong to the user!';
        END IF;

        -- Clean up phone number
        SET cleaned_phone_number = p_phone_number;
        IF LEFT(cleaned_phone_number, 1) = '0' AND MID(cleaned_phone_number, 2, 1) = ' ' THEN
            SET cleaned_phone_number = SUBSTRING(cleaned_phone_number, 2);
        END IF;

        -- Determine address type
        SET v_address_type = IF(p_tax_or_national_id IS NOT NULL AND p_tax_or_national_id <> '', 1, 0);

        -- Perform the update
       IF v_address_type = 1 THEN
    UPDATE user_address
    SET
		user_firstname = p_first_name,
		user_lastname = p_last_name,
		neighborhood_id = p_neighborhood_id,
		user_address_note = p_address_note,
		user_address_phone = cleaned_phone_number,
		user_address_type = v_address_type,
        user_address_taxornationalid = p_tax_or_national_id,
        user_address_tax_office = p_tax_office,
        user_address_company_name = p_company_name,
        user_address_einvoice_taxpayer = p_is_einvoice
    WHERE user_address_id = p_user_address_id AND user_id = p_user_id;

-- Else, clear company-related fields
ELSE
    UPDATE user_address
    SET
		user_firstname = p_first_name,
		user_lastname = p_last_name,
		neighborhood_id = p_neighborhood_id,
		user_address_note = p_address_note,
		user_address_phone = cleaned_phone_number,
		user_address_type = v_address_type,
        user_address_taxornationalid = NULL,
        user_address_tax_office = NULL,
        user_address_company_name = NULL,
        user_address_einvoice_taxpayer = NULL
    WHERE user_address_id = p_user_address_id AND user_id = p_user_id;
END IF;
    END IF;
END ;;
DELIMITER ;
