CREATE DEFINER=`root`@`localhost` PROCEDURE `user_login`(
    IN p_email VARCHAR(255),
    IN p_password VARCHAR(255), -- Plaintext password from user
    OUT p_user_id INT,
    OUT p_hashed_password VARCHAR(255),
    OUT p_mail VARCHAR(255)
)
BEGIN
    -- Check if user exists and retrieve user details
    SELECT user_id, password, mail
    INTO p_user_id, p_hashed_password, p_mail
    FROM user_tb
    WHERE mail = p_email;

    -- If no user found, return NULL
    IF p_user_id IS NULL THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Invalid email or password.';
    END IF;
END ;;
