CREATE DEFINER=`root`@`localhost` PROCEDURE `user_order_detail`(
    IN p_user_id INT,
    IN p_order_id BIGINT
)
BEGIN
    -- Check if the order exists and belongs to the user
    IF NOT EXISTS (
        SELECT 1
        FROM mysqltestdb.order_tb o
        WHERE o.order_id = p_order_id AND o.user_id = p_user_id
    ) THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'Order not found for the given user.';
    ELSE

        -- First result set: Products grouped by shipment/seller
        SELECT 
            p.product_id,
            p.product_name,
            od.product_quantity,
            od.product_price AS order_product_price,
            od.type_id,
            pt.type_name AS product_type_name,
            od.created_at AS order_created_at,
            s.shipping_company,
            s.shipping_status,
            s.tracking_number AS shipping_tracking_code,
            s.eta AS shipping_eta,
            od.seller_id,
            b.brand_name,
            pi.image_filename,
            p.product_link,

            -- Seller info from order_detail seller_id
            seller.admin_company_name AS seller_company_name,
            seller.admin_username AS seller_username,
            seller.admin_mail AS seller_mail,

            -- Added user (original uploader of product)
            added_user.admin_company_name AS added_user_company_name,
            added_user.admin_username AS added_user_username,
            added_user.admin_mail AS added_user_mail

        FROM mysqltestdb.order_detail_tb od
        JOIN mysqltestdb.products_tb p ON od.product_id = p.product_id
        JOIN mysqltestdb.order_tb o ON od.order_id = o.order_id
        JOIN mysqltestdb.product_brand_tb b ON b.brand_id = p.product_brand_id
        LEFT JOIN mysqltestdb.product_types_tb pt ON pt.type_id = od.type_id
        LEFT JOIN mysqltestdb.shipment_tb s ON od.shipment_id = s.shipment_id
        LEFT JOIN mysqltestdb.product_images_tb pi 
            ON pi.product_id = p.product_id AND pi.display_order = 1
        LEFT JOIN mysqltestdb.admin_tb seller ON od.seller_id = seller.admin_id
        LEFT JOIN mysqltestdb.admin_tb added_user ON p.added_user_id = added_user.admin_id
        WHERE od.order_id = p_order_id
          AND o.user_id = p_user_id;

        -- Second result set: Order and address summary
        SELECT 
            o.order_id,
            o.user_id,
            o.order_name,
            o.order_surname,
            o.order_phone_number,
            o.order_address_note,
            o.order_billing_name,
            o.order_billing_surname,
            o.order_billing_phone_number,
            o.order_billing_address_note,
            o.order_total_price,
            o.created_at,
            o.order_status,

            -- Shipping Address
            sn.neighborhood_id AS shipping_neighborhood_id,
            sn.neighborhood_name AS shipping_neighborhood_name,
            sd.district_id AS shipping_district_id,
            sd.district_name AS shipping_district_name,
            sp.province_id AS shipping_province_id,
            sp.province_name AS shipping_province_name,

            -- Billing Address
            bn.neighborhood_id AS billing_neighborhood_id,
            bn.neighborhood_name AS billing_neighborhood_name,
            bd.district_id AS billing_district_id,
            bd.district_name AS billing_district_name,
            bp.province_id AS billing_province_id,
            bp.province_name AS billing_province_name

        FROM mysqltestdb.order_tb o
        LEFT JOIN mysqltestdb.address_neighborhood_tb sn ON o.order_neighborhood_id = sn.neighborhood_id
        LEFT JOIN mysqltestdb.address_district_tb sd ON sn.district_id = sd.district_id
        LEFT JOIN mysqltestdb.address_province_tb sp ON sd.province_id = sp.province_id
        LEFT JOIN mysqltestdb.address_neighborhood_tb bn ON o.order_billing_neighborhood_id = bn.neighborhood_id
        LEFT JOIN mysqltestdb.address_district_tb bd ON bn.district_id = bd.district_id
        LEFT JOIN mysqltestdb.address_province_tb bp ON bd.province_id = bp.province_id
        WHERE o.user_id = p_user_id AND o.order_id = p_order_id;

    END IF;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
