CREATE DEFINER=`root`@`localhost` PROCEDURE `user_order_final`(IN p_user_id INT)
BEGIN
    DECLARE cart_count INT DEFAULT 0;
    DECLARE v_now DATETIME;
    DECLARE v_order_id BIGINT;
    DECLARE v_total_price DECIMAL(10,2) DEFAULT 0;

    -- Address
    DECLARE v_firstname VARCHAR(100);
    DECLARE v_lastname VARCHAR(100);
    DECLARE v_neighborhood_id INT;
    DECLARE v_address_note VARCHAR(255);
    DECLARE v_address_phone VARCHAR(50);

    -- Coupon
    DECLARE v_coupon_id INT DEFAULT NULL;
    DECLARE v_coupon_discount DECIMAL(10,2) DEFAULT 0;

    -- Per-item vars
    DECLARE v_product_id INT;
    DECLARE v_quantity INT;
    DECLARE v_price DECIMAL(10,2);
    DECLARE v_seller_id INT;
    DECLARE v_type_id INT;
    DECLARE v_shipment_id BIGINT;

    /* 1) Cart check */
    SELECT COUNT(*) INTO cart_count
    FROM shoppingcart_tb
    WHERE user_id = p_user_id AND cart_status = 1;

    IF cart_count > 0 THEN
        SET v_now = NOW();

        /* 2) Address (SAFE: subselects never raise NOT FOUND) */
        SELECT
            (SELECT ua.user_firstname
               FROM user_selected_address usa
               JOIN user_address ua ON usa.user_address_id = ua.user_address_id
              WHERE ua.user_id = p_user_id
              LIMIT 1) AS fn,
            (SELECT ua.user_lastname
               FROM user_selected_address usa
               JOIN user_address ua ON usa.user_address_id = ua.user_address_id
              WHERE ua.user_id = p_user_id
              LIMIT 1) AS ln,
            (SELECT ua.neighborhood_id
               FROM user_selected_address usa
               JOIN user_address ua ON usa.user_address_id = ua.user_address_id
              WHERE ua.user_id = p_user_id
              LIMIT 1) AS nb,
            (SELECT ua.user_address_note
               FROM user_selected_address usa
               JOIN user_address ua ON usa.user_address_id = ua.user_address_id
              WHERE ua.user_id = p_user_id
              LIMIT 1) AS note,
            (SELECT ua.user_address_phone
               FROM user_selected_address usa
               JOIN user_address ua ON usa.user_address_id = ua.user_address_id
              WHERE ua.user_id = p_user_id
              LIMIT 1) AS phone
        INTO v_firstname, v_lastname, v_neighborhood_id, v_address_note, v_address_phone;

        /* 3) Total price */
        SELECT IFNULL(SUM(pp.product_price * s.quantity), 0)
          INTO v_total_price
        FROM shoppingcart_tb s
        JOIN product_prices_tb pp
            ON s.product_id = pp.product_id
           AND s.type_id   = pp.product_type
           AND s.seller_id = pp.admin_id
        WHERE s.user_id = p_user_id AND s.cart_status = 1;

        /* 4) Coupon (SAFE: subselects => NULL/0, no handler side-effects) */
        SELECT
          (SELECT ca.coupon_id
             FROM coupon_active_tb ca
            WHERE ca.user_id = p_user_id
            LIMIT 1),
          (SELECT c.discount_amount
             FROM coupon_active_tb ca
             JOIN coupons_tb c ON ca.coupon_id = c.coupon_id
            WHERE ca.user_id = p_user_id
            LIMIT 1)
        INTO v_coupon_id, v_coupon_discount;

        IF v_coupon_id IS NOT NULL THEN
            SET v_total_price = GREATEST(0, v_total_price - IFNULL(v_coupon_discount,0));
        END IF;

        /* 5) Insert order */
        INSERT INTO order_tb (
            user_id, order_name, order_surname,
            order_phone_number, order_neighborhood_id, order_address_note,
            order_billing_name, order_billing_surname, order_billing_phone_number,
            order_billing_neighborhood_id, order_billing_address_note,
            order_total_price, coupon_id, created_at, order_status
        )
        VALUES (
            p_user_id, v_firstname, v_lastname,
            v_address_phone, v_neighborhood_id, v_address_note,
            v_firstname, v_lastname, v_address_phone,
            v_neighborhood_id, v_address_note,
            v_total_price, v_coupon_id, v_now, 1
        );

        SET v_order_id = LAST_INSERT_ID();

        /* 6) TEMP seller->shipment map */
        DROP TEMPORARY TABLE IF EXISTS tmp_shipments;
        CREATE TEMPORARY TABLE tmp_shipments (
            seller_id INT PRIMARY KEY,
            shipment_id BIGINT
        );

        /* 7) Cursor block (handler scoped ONLY here) */
        BEGIN
            DECLARE done INT DEFAULT 0;

            DECLARE cur CURSOR FOR
                SELECT 
                    s.product_id,
                    s.quantity,
                    pp.product_price,
                    pp.admin_id, -- seller_id
                    s.type_id
                FROM shoppingcart_tb s
                JOIN product_prices_tb pp 
                      ON s.product_id = pp.product_id
                     AND s.type_id   = pp.product_type
                     AND s.seller_id = pp.admin_id
                WHERE s.user_id = p_user_id AND s.cart_status = 1;

            DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

            OPEN cur;
            read_loop: LOOP
                FETCH cur INTO v_product_id, v_quantity, v_price, v_seller_id, v_type_id;
                IF done THEN
                    LEAVE read_loop;
                END IF;

                /* Shipment per seller */
                IF NOT EXISTS (SELECT 1 FROM tmp_shipments WHERE seller_id = v_seller_id) THEN
                    INSERT INTO shipment_tb (
                        order_id, tracking_number, shipping_company, eta, shipment_price
                    )
                    VALUES (
                        v_order_id,
                        FLOOR(1000000000 + (RAND() * 8999999999)),
                        'FakeShipping Co.',
                        DATE_ADD(v_now, INTERVAL 2 DAY),
                        50
                    );
                    SET v_shipment_id = LAST_INSERT_ID();

                    INSERT INTO tmp_shipments (seller_id, shipment_id)
                    VALUES (v_seller_id, v_shipment_id);
                ELSE
                    SELECT shipment_id INTO v_shipment_id
                    FROM tmp_shipments
                    WHERE seller_id = v_seller_id;
                END IF;

                /* Order detail */
                INSERT INTO order_detail_tb (
                    order_id, seller_id, product_id, product_quantity,
                    product_price, created_at, shipment_id, type_id
                )
                VALUES (
                    v_order_id, v_seller_id, v_product_id, v_quantity,
                    v_price, v_now, v_shipment_id, v_type_id
                );
            END LOOP;
            CLOSE cur;
        END;
        /* 8) Clear shopping cart */
        DELETE FROM shoppingcart_tb
        WHERE user_id = p_user_id AND cart_status = 1;

		/* 9) Consume coupon if used */
        IF v_coupon_id IS NOT NULL THEN
            -- 1) Kullanılmış kuponu geçmişe kaydet
            INSERT INTO coupon_user_tb (coupon_id, user_id, used_at)
            VALUES (v_coupon_id, p_user_id, v_now);

            -- 2) Aktif kupondan sil ki tekrar aynı siparişe uygulanmasın
            DELETE FROM coupon_active_tb
            WHERE user_id = p_user_id AND coupon_id = v_coupon_id;
        END IF;

    END IF;

    /* 10) Return order id */
    SELECT v_order_id AS order_id;
END ;;
