CREATE DEFINER=`root`@`localhost` PROCEDURE `user_register`(
    IN p_email VARCHAR(255),
    IN p_hashed_password VARCHAR(255), -- Already hashed password from PHP
    OUT p_user_id INT
)
BEGIN
    DECLARE user_exists INT;

    -- Check if email already exists
    SELECT COUNT(*) INTO user_exists FROM user_tb WHERE mail = p_email;

    IF user_exists > 0 THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'E-mail already exists.';
    ELSE
        -- Insert user into database (password is already hashed)
        INSERT INTO user_tb (mail, password, created_at)
        VALUES (p_email, p_hashed_password, NOW());

        -- Return inserted user ID
        SET p_user_id = LAST_INSERT_ID();
    END IF;
END ;;
