CREATE DEFINER=`root`@`localhost` PROCEDURE `user_toggle_address`(
  IN p_user_id INT
)
BEGIN
  DECLARE v_addr    INT;
  DECLARE v_bill    INT;

  -- Fetch the current delivery & billing for this user
  SELECT usa.user_address_id,
         usa.user_billing_address_id
    INTO v_addr, v_bill
    FROM user_selected_address usa
    JOIN user_address ua 
      ON usa.user_address_id = ua.user_address_id
   WHERE ua.user_id = p_user_id
   LIMIT 1;

  -- If there is a billing address, move it into delivery and clear billing
  IF v_bill IS NOT NULL THEN
    UPDATE user_selected_address usa
      JOIN user_address ua 
        ON usa.user_address_id = ua.user_address_id
       AND ua.user_id = p_user_id
      SET 
        usa.user_billing_address_id = NULL,
        usa.last_updated_at         = NOW();
  
  -- Otherwise (no billing), move delivery into billing and clear delivery
  ELSE
    UPDATE user_selected_address usa
      JOIN user_address ua 
        ON usa.user_address_id = ua.user_address_id
       AND ua.user_id = p_user_id
      SET 
        usa.user_billing_address_id = usa.user_address_id,
        usa.last_updated_at         = NOW();
  END IF;

END ;;
